(51, '', '', '', '', '', '', '', 'chinh-sach-ve-quy-trinh-xu-ly-khieu-nai', '', '', '', '', '', 1, 0, 1557394739, 0, '', '', '', '', '', '', 'Chính sách về quy trình xử lý khiếu nại', '', 25, '', '', '', 'chinh-sach', 0, 0),
(52, '', '', '', '', '', '', '', 'chinh-sach-van-chuyen-giao-nhan', '', '<div class=\"title_fck \" style=\"box-sizing: border-box; font-weight: 700; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><a aria-controls=\"phivanchuyen_fck_1\" aria-expanded=\"true\" data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"https://hasaki.vn/thong-tin-ho-tro#quytrinhgiaohang_fck_1\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none; display: block; position: relative;\">Quy trình giao hàng:</a></div>  <div aria-labelledby=\"\" class=\"fck_support_page panel-collapse collapse in\" id=\"quytrinhgiaohang_fck_1\" role=\"tabpanel\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"> <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">a. Hệ thống liên lạc với bạn để thống nhất thời gian giao hàng sẽ giao sản phẩm đến địa điểm mà bạn đã cung cấp trong đơn đặt hàng. Hệ thống sẽ cố gắng <b style=\"box-sizing: border-box;\">giao hàng trong thời gian từ 24h đến 48h giờ</b> làm kể từ lúc quý khách đặt hàng. Tuy nhiên, vẫn có những sự chậm trễ do nguyên nhân khách quan (lễ, tết, địa chỉ nhận hàng khó tìm, sự chậm trễ từ dịch vụ chuyển phát…), rất mong bạn có thể thông cảm vì những lý do ngoài sự chi phối của chúng tôi.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">b. Nếu quý khách không thể có mặt trong đợt nhận hàng thứ nhất, Hệ thống sẽ liên lạc lại với quý khách để sắp xếp thời gian giao hàng hoặc hướng dẫn bạn đến công ty vận chuyển để nhận hàng.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">c. Nếu việc giao và nhận hàng không thành công do không thể liên lạc được với quý khách trong vòng 3 ngày, chúng tôi sẽ thông báo đến bạn về việc hủy đơn hàng và hoàn trả các chi phí mà bạn đã thanh toán trong vòng 30 ngày.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">d. Hệ thống sẽ báo ngay đến bạn nếu có sự chậm trễ khi giao hàng, nhưng trong phạm vi pháp luật cho phép, chúng tôi sẽ không chịu trách nhiệm cho bất cứ tổn thất nào, các khoản nợ, thiệt hại hoặc chi phí phát sinh từ việc giao hàng trễ.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">e. Hệ thống lưu ý với bạn rằng có một số địa điểm mà dịch vụ chuyển phát không thể giao hàng được. Khi đó, Hệ thống sẽ thông báo đến bạn qua thông tin liên lạc mà bạn đã cung cấp khi đặt hàng. Chúng tôi có thể sắp xếp giao hàng đến một địa chỉ khác thuận tiện hơn hoặc tiến hành hủy đơn hàng.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">f. Khi nhận sản phẩm, quý khách vui lòng kiểm tra kỹ sản phẩm trước khi ký nhận hàng hóa. Bạn nên giữ lại biên lai mua hàng để làm bằng chứng trong trường hợp muốn liên hệ lại về sản phẩm đã mua.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">g. Quý khách nên cẩn thận khi sử dụng vật sắc nhọn để mở sản phẩm vì bạn có thể làm hỏng sản phẩm. Hệ thống không chịu bất cứ rủi ro, tổn thất, hư hại về sản phẩm sau khi bạn đã kiểm tra kỹ lưỡng và ký nhận sản phẩm.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">h. Sản phẩm được đóng gói theo tiêu chuẩn đóng gói của Hệ thống. Nếu bạn có nhu cầu đóng gói đặc biệt khác, vui lòng cộng thêm phí phát sinh.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">i. Trong trường hợp những đơn hàng đã xác nhận của quý khách được đặt ở những ngày gần nhau, <a href=\"https://hasaki.vn/\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none;\">Hệ thống</a> sẽ cố gắng bổ sung vào đơn hàng và giao chung một lần cho quý khách.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">j. Mọi thông tin về việc thay đổi hay hủy bỏ đơn hàng đề nghị quý khách thông báo sớm để <a href=\"https://hasaki.vn/\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none;\">Hệ thống</a> có thể hủy hoặc chỉnhh sửa đơn hàng cho bạn.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">k. Chỉ nhận đổi trả sản phẩm khi lỗi đến từ nhà sản xuất hoặc bị hư hỏng trong quá trình vận chuyển với điều kiện không quá 3 ngày sau khi giao hàng.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">l. Hệ thống nhận giao sản phẩm đến tận tay khách hàng và thanh toán khi nhận hàng hoặc quý khách hàng có thể chọn hình thức chuyển khoản trước (nếu muốn). <b style=\"box-sizing: border-box;\">Lưu ý</b> các đơn hàng có giá trị trên 5.000.000đ chỉ được áp dụng hình thức chuyển khoản.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">m. Đối với những đơn hàng có sản phẩm Pre-Oder (đặt hàng trước), Hệ thống sẽ tiến hành giao sau khi các sản phẩm Pre-Oder đã về hàng.</p> </div>', '', '', '', 1, 1, 1557394739, 0, '', '', '', '', '', '', 'Chính sách vận chuyển, giao nhận', '', 29, '', '', '', 'chinh-sach', 1, 0),
(53, '', '', '', '', '', '', '', 'chinh-sach-va-quy-dinh-chung', '', '', '', '', '', 1, 0, 1557394739, 0, '', '', '', '', '', '', 'Chính sách và quy định chung', '', 28, '', '', '', 'chinh-sach', 0, 0),
(54, '', '', '', '', '', '', '', 'chinh-sach-bao-mat-thong-tin-khach-hang', '', '<div class=\"title_fck \" style=\"box-sizing: border-box; font-weight: 700; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><a aria-controls=\"phivanchuyen_fck_1\" aria-expanded=\"true\" data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"https://hasaki.vn/thong-tin-ho-tro#chinhsachbaomat_fck_1\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none; display: block; position: relative;\">Chính sách bảo mật</a></div>  <div aria-labelledby=\"\" class=\"fck_support_page panel-collapse collapse in\" id=\"chinhsachbaomat_fck_1\" role=\"tabpanel\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"> <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><b style=\"box-sizing: border-box;\">1. Mục đích:</b></p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">Hiện nay, vấn đề bảo mật thông tin đã trở thành vấn đề nóng trên tất cả các diễn đàn, điều này không chỉ gây khó khăn cho các tổ chức, cá nhân tham gia truy cập và giao dịch mà còn gây nên những phiền toái vượt ra ngoài tầm kiểm soát của hệ thống.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">Chính sách bảo mật và chia sẻ thông tin khách hàng của <a href=\"https://hasaki.vn/\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none;\">Hệ Thống</a> như một lời cam kết với mong muốn nâng cao chất lượng dịch vụ, bảo đảm an toàn thông tin của các cá nhân, tổ chức khi tham gia truy cập hoặc giao dịch trực tiếp trên website <a href=\"https://hasaki.vn/\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none;\">Hệ Thống</a>. Chúng tôi hiểu bảo vệ và sử dụng hợp lí thông tin của bạn cũng chính là bảo vệ lòng tin và sự yêu mến của bạn dành cho chúng tôi.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><b style=\"box-sizing: border-box;\">2. Các điều khoản áp dụng</b></p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">    2.1. Cập nhật thông tin khách hàng:</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">- Khi tham gia mở tài khoản hoặc giao dịch trực tiếp trên <a href=\"https://hasaki.vn/\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none;\">H</a>ệ thống, khách hàng cần phải cung cấp đầy đủ các thông tin bắt buộc bao gồm tên, địa chỉ, số điện thoại... cụ thể để có thể đáp ứng các điều kiện giao dịch cần thiết.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">- Các thông tin cá nhân quý khách cung cấp cho Hệ thống cần đảm bảo độ chính xác và đầy đủ để phòng tránh trường hợp nhầm lẫn hoặc giả mạo. Mọi sự sai sót hoặc không chính xác trong thông tin được cung cấp sẽ ảnh hưởng trực tiếp đến quyền lợi của quý khách hàng. Do đó, Hệ thống sẽ không chịu trách nhiệm đối với những tranh chấp phát sinh có liên quan trong trường hợp này.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">    2.2.Lưu giữ và bảo mật thông tin khách hàng</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">- Tất cả các thông tin khách hàng cung cấp và nội dung giao dịch đều được hệ thống lưu giữ bảo mật tuyệt đối trên hệ thống. Hệ thống cam đoan sẽ không bán hoặc chia sẻ dẫn đến làm lộ thông tin cá nhân của bạn, không vì những mục đích thương mại mà vi phạm cam kết của chúng tôi ghi trong chính sách bảo mật này</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">- <a href=\"https://hasaki.vn/\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none;\">Hệ Thống</a> luôn sẵn sàng về đội ngũ kĩ thuật và an ninh để có những biện pháp đối phó với những trường hợp cố tình xâm nhập và sử dụng trái phép thông tin của khách hàng. Khi thu thập dữ liệu, hệ thống thực hiện lưu giữ và bảo mật thông tin khách hàng tại hệ thống máy chủ và các thông tin khách hàng này được bảo đảm an toàn bằng các hệ thống bảo vệ tốt nhất hiện nay, cùng các biện pháp kiểm soát truy cập và mã hóa dữ liệu.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">- Khách hàng không được phép sử dụng bất kì chương trình hay công cụ nào nhằm mục đích khai thác, thay đổi dữ liệu bất hợp pháp trên hệ thống. Mọi hành vi cố tình xâm phạm, tùy theo tính chất sự việc, chúng tôi có quyền khởi tố với các cơ quan có thẩm quyền theo quy định pháp luật hiện hành.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">- Khách hàng nên tự bảo vệ thông tin bảo mật của mình bằng cách không chia sẻ các thông tin cá nhân cũng như các thông tin giao dịch với bên thứ ba, cẩn thận trong việc đăng nhập/đăng xuất tài khoản để loại trừ những sự cố rò rỉ thông tin không đáng có.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">    2.3.Sử dụng thông tin</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><a href=\"https://hasaki.vn/\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none;\">Hệ Thống</a> có quyền sử dụng hợp pháp các thông tin cá nhân của khách hàng trong các trường hợp để đảm bảo quyền lợi của quý khách như:</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">-Thông báo các thông tin về dịch vụ quảng cáo, các chương trình khuyến mãi… đến khách hàng theo nhu cầu và thói quen của quý khách khi truy cập</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">-Liên lạc và hỗ trợ khách hàng trong những trường hợp đặc biệt</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">-Phát hiện và ngăn chặn ngay lập tức các hành vi can thiệp hoặc phá hoại tài khoản của khách hàng</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">    2.4.Chia sẻ thông tin</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><a href=\"https://hasaki.vn/\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none;\">Hệ Thống</a> cam kết không tiết lộ thông tin khách hàng cho bên thứ ba ngoại trừ các trường hợp sau:</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">- Thực hiện theo yêu cầu của các các cá nhân, tổ chức có thẩm quyền theo quy định của pháp luật</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">-Cần thiết phải sử dụng các thông tin để phục vụ cho việc cung cấp các dịch vụ/tiện ích cho khách hàng</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">-Nghiên cứu thị trường và đánh giá phân tích</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">- Trao đổi thông tin khách hàng với đối tác hoặc đại lí phân phối để phân tích nâng cao chất lượng dịch vụ</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">- Ngoài các trường hợp trên, khi cần phải trao đổi thông tin khách hàng cho bên thứ ba, <a href=\"https://hasaki.vn/\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); text-decoration-line: none; background-color: transparent; outline: none;\">H</a>ệ thống sẽ thông báo trực tiếp với khách hàng và sẽ chỉ thực hiện việc trao đổi thông tin khi có sự đồng thuận từ phía khách hàng.</p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><b style=\"box-sizing: border-box;\">3. Liên hệ và giải đáp thắc mắc</b></p>  <p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">Mọi ý kiến đóng góp/nhu cầu hỗ trợ vui lòng gọi vào Hotline: 0383061717<b style=\"box-sizing: border-box;\"> </b>, Email: tranhobaohoang@gmail.com</p> </div>', '', '', '', 1, 1, 1557394739, 0, '', '', '', '', '', '', 'Chính sách bảo mật thông tin khách hàng', '', 34, '', '', '', 'chinh-sach', 1, 0),
(55, '', '', '', '', '', '', '', 'chinh-sach-doi-tra-hang-va-hoan-tien', '', '', '', '', '', 1, 0, 1557394739, 0, '', '', '', '', '', '', 'Chính sách đổi trả hàng và hoàn tiền', '', 35, '', '', '', 'chinh-sach', 0, 0),
(57, 'bảo hành', '', 'bảo hành', '', 'trong thời gian sử dụng điều hòa âm trần và các loại khác nếu gặp bất kỳ trục trặc nào hoặc lỗi do người sử dụng, khách hàng có thể liên lạc trực tiếp với Trung tâm bảo hành của Hãng hoặc Trung tâm Chăm sóc khách hàng của công ty Hưng Phát để được trợ giúp. \r\n\r\nI/ Bảo hành:\r\n\r\nBảo hành sản phẩm là: khắc phục những lỗi hỏng hóc, sự cố kỹ thuật xảy ra do lỗi của nhà sản xuất\r\n\r\nII/ Quy định về bảo hành:\r\n\r\n- Sản phẩm được bảo hành miễn phí nếu sản phẩm đó còn thời hạn bảo hành được tính kể từ ngày giao hàng.\r\n\r\n- Thời hạn bảo hành được ghi trên Phiếu Bảo hành và theo quy định của từng hãng sản xuất đối với tất cả các sự cố về mặt kỹ thuật.\r\n\r\n- Có phiếu bảo hành và tem bảo hành của công ty trên sản phẩm.\r\n\r\nIII/ Những trường hợp không được bảo hành:\r\n\r\n- Sản phẩm đã quá thời hạn bảo hành ghi trên phiếu hoặc mất Phiếu Bảo hành.\r\n\r\n- Tem niêm phong bảo hành bị rách, vỡ, bị dán đè hoặc bị sửa đổi.\r\n\r\n- Phiếu bảo hành không ghi rõ số Serial và ngày mua hàng.\r\n\r\n- Số máy trên sản phẩm không xác định được hoặc sai so', '', '', 'chinh-sach-bao-hanh', 'BẢO HÀNH MIỄN PHÍ TRÊN SẢN PHẨM CỦA CHÚNG TÔI', '<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">trong thời gian sử dụng&nbsp;<a href=\"http://hopphat.com/dieu-hoa-am-tran-cassette.html\" style=\"color: rgb(51, 51, 51);\">điều hòa âm trần</a>&nbsp;và các loại khác nếu gặp bất kỳ trục trặc nào hoặc lỗi do người sử dụng, khách hàng có thể liên lạc trực tiếp với Trung tâm bảo hành của Hãng hoặc Trung tâm Chăm sóc khách hàng của công ty Hưng&nbsp;Phát để được trợ giúp.&nbsp;</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\"><strong>I/ Bảo hành:</strong></p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">Bảo hành sản phẩm là: khắc phục những lỗi hỏng hóc, sự cố kỹ thuật xảy ra do lỗi của nhà sản xuất</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\"><strong>II/ Quy định về bảo hành:</strong></p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Sản phẩm được bảo hành miễn phí nếu sản phẩm đó còn thời hạn bảo hành được tính kể từ ngày giao hàng.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Thời hạn bảo hành được ghi trên Phiếu Bảo hành và theo quy định của từng hãng sản xuất đối với tất cả các sự cố về mặt kỹ thuật.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Có phiếu bảo hành và tem bảo hành của công ty trên sản phẩm.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\"><strong>III/ Những trường hợp không được bảo hành:</strong></p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Sản phẩm đã quá thời hạn bảo hành ghi trên phiếu hoặc mất Phiếu Bảo hành.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Tem niêm phong bảo hành bị rách, vỡ, bị dán đè hoặc bị sửa đổi.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Phiếu bảo hành không ghi rõ số Serial và ngày mua hàng.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Số máy trên sản phẩm không xác định được hoặc sai so với số máy được ghi trên phiếu bảo hành.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Sản phẩm bị hư hỏng do tác động cơ học làm rơi, vỡ, va đập, trầy xước, móp méo, ẩm ướt, hoen rỉ, chảy nước hoặc do hỏa hoạn, thiên tai gây nên.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Sản phẩm có dấu hiệu hư hỏng do chuột bọ hoặc côn trùng xâm nhập.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Sử dụng không đúng sách hướng dẫn, sử dụng sai điện áp quy định.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Các phần mềm cung cấp miễn phí kèm theo máy.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Tự ý tháo dỡ, sửa chữa bởi các cá nhân hoặc kỹ thuật viên không được sự ủy quyền của Hợp Phát</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">- Chưa thanh toán đầy đủ theo quy định</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\"><strong>IV/ Bảo trì:</strong></p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">Bảo trì, bảo dưỡng bao gồm: Bảo dưỡng sản phẩm định kỳ, nạp ga, rửa lưới lọc, quét bụi bên trong, lau chùi sản phẩm, diệt virus, cài đặt các chương trình, sửa chữa những hỏng hóc nhỏ có thể sửa được (không bao gồm thay thế thiết bị).Thời gian bảo trì bảo dưỡng tùy thuộc vào sự thỏa thuận giữa Hợp Phát và khách hàng.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\"><strong>CAM KẾT BẢO HÀNH VÀ DỊCH VỤ HẬU MÃI CỦA CÔNG TY HƯNG PHÁT</strong></p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">1-&nbsp;&nbsp;&nbsp;Cam kết bảo hành</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\"><strong>Đối với Điều hòa Daikin:&nbsp;</strong>Bảo hành 01 năm với toàn bộ thiết bị, riêng máy nén bảo hành 4 năm.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Đối với Điều hòa khác:&nbsp;</strong>Bảo hành theo quy định riêng của hãng sản xuất nhưng không dưới 01 năm bảo hành.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">2-&nbsp;&nbsp;&nbsp;Miễn phí một số dịch vụ theo các đợt khuyến mãi của nhà sản xuất (nếu có) trong quá trình sử dụng thiết bị.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">&nbsp;3-&nbsp;&nbsp;&nbsp;Trong thời gian bảo hành, ngay sau khi nhận được thông báo của bên mua về hư hỏng của thiết bị nếu không phải do lỗi của người sử dụng, chúng tôi sẽ khẩn trương tiến hành thay thế hoặc sửa chữa các thiết bị hư hỏng bằng thiết bị mới. Mọi chi phí liên quan đến thay thế sẽ do công ty Hưng&nbsp;Phát chịu.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">&nbsp;4-&nbsp;&nbsp;&nbsp;Trong vòng 24h kể từ lúc nhận được thông báo của bên mời thầu, nhân viên kỹ thuật của Hợp Phát sẽ có mặt để xử lý đối với những công trình trong nội thành tphcm&nbsp;và trong vòng 48h đối với công trình ngoài phạm vi tphcm</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">&nbsp;5-&nbsp;&nbsp;&nbsp;Trong trường hợp có sự cố của thiết bị do lỗi của người sử dụng, chúng tôi vẫn tiến hành sửa chữa hoặc thay thế và miễn phí tiền công dịch vụ. Phần thiết bị thay thế (nếu có) sẽ tính với bên mua theo giá thị trường.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">&nbsp;6-&nbsp;&nbsp;&nbsp;Công ty Hưng&nbsp;Phát luôn duy trì trong kho của mình một số lượng an toàn và sẵn sàng cung cấp nhanh chóng các thiết bị và phụ tùng thay thế chính hiệu để phục vụ bảo hành và dịch vụ hậu mãi cho máy điều hòa như:</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">-&nbsp;&nbsp;Compressor, motor, mạch điện tử và nhiều phụ tùng khác phục vụ hệ thống…</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">-&nbsp;&nbsp;Các loại vật tư chuyên dụng như gas, nhớt lạnh….</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">-&nbsp;&nbsp;Thiết bị điện, các phụ kiện trong tủ điện…</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">-&nbsp;&nbsp;Các vật tư thường dùng khác…</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">&nbsp;7-&nbsp;&nbsp;&nbsp;Công ty Hưng&nbsp;Phát có quan hệ đối tác với các hãng cung cấp các sản phẩm máy lạnh… để có thể đáp ứng nhanh chóng nhu cầu sử dụng của khách hàng</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">&nbsp;8-&nbsp;&nbsp;&nbsp;Công ty Hưng&nbsp;Phát có đội ngũ kỹ sư, kỹ thuật bảo trì sửa chữa được tuyển chọn và đào tạo có hệ thống, có kinh nghiệm nhiều năm trong lĩnh vực điện lạnh, có sự hỗ trợ kỹ thuật từ các nhà cung cấp trên thế giới như Daikin, Mitsubishi…, được trang bị đầy đủ các thiết bị đo kiểm chuyên dụng.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">&nbsp;9-&nbsp;&nbsp;&nbsp;Bộ phận bảo trì được hỗ trợ bởi các xưởng gia công cơ khí, xưởng chế tạo tủ điện, xưởng lắp ráp thiết bị lạnh, phòng kỹ thuật và có thể giải quyết mọi vấn đề sửa chữa lớn, đại tu hệ thống.</p>\r\n\r\n<p style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;\">&nbsp;10-&nbsp;Công ty Hưng&nbsp;Phát có thể&nbsp; tư vấn giúp khách hàng xây dựng lịch bảo trì phù hợp với các đặc thù của công trình. Ngoài ra có thể cung cấp các hợp đồng dịch vụ bảo trì ngăn ngừa hoặc bao trọn gói, với mục tiêu giảm chi phí vận hành tổng cộng cho khách hàng, duy trì hoạt động ổn định hiệu quả, kéo dài tuổi thọ của thiết bị.</p>\r\n', '', '', '', 1, 0, 1557394739, 1467014207, '', '', '', '', '', '', 'Chính sách bảo hành', '', 17, 'BẢO HÀNH', 'BẢO HÀNH', 'BẢO HÀNH', 'chinh-sach', 0, 0),
