(164, '', '', '', '', '', '', '', 'tuyen-dung', '', '<div class=\"title_dangtuyen txt_16 space_bottom_10\" style=\"box-sizing: border-box; font-size: 16px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box;\">Nhân viên CONTENT cho các Sản Phẩm Mẹ & Bé</strong></div>\r\n\r\n<div class=\"content_dangtuyen width_common\" style=\"box-sizing: border-box; width: 1058px; float: left; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"> </p>\r\n\r\n<div class=\"space_bottom_20\" style=\"box-sizing: border-box; margin-bottom: 20px;\">Nơi làm việc:   Tp.Hồ Chí Minh <br style=\"box-sizing: border-box;\" />\r\nLương: Thỏa thuận<br style=\"box-sizing: border-box;\" />\r\nGiờ làm việc: Thứ 2 đến Thứ 6: 8h- 17h30 , Thứ 7: 8h -12h</div>\r\n\r\n<div class=\"space_bottom_20\" style=\"box-sizing: border-box; margin-bottom: 20px;\"><strong style=\"box-sizing: border-box;\">Mô tả công việc</strong><br style=\"box-sizing: border-box;\" />\r\n+ Lên sản phẩm trên web NAPIESKIN<br style=\"box-sizing: border-box;\" />\r\n+ Viết nội dung cho các sản phẩm Mẹ và Bé trên website, facebook,...<br style=\"box-sizing: border-box;\" />\r\n+ Viết bài Sản phẩm cẩn thận, chịu khó tìm tòi, tham khảo thông tin sản phẩm từ nhiều nguồn, xem review của khách, cũng như hình ảnh để viết & đem thông tin đúng cho khách hàng.<br style=\"box-sizing: border-box;\" />\r\n+ Kỹ năng tìm kiếm thông tin trên Internet tốt.<br style=\"box-sizing: border-box;\" />\r\n+ Hiểu biết về sản phẩm Mẹ và Bé là 1 lợi thế.<br style=\"box-sizing: border-box;\" />\r\n+ Báo cáo công việc phụ trách với bộ phận quản lý.</div>\r\n\r\n<div class=\"space_bottom_20\" style=\"box-sizing: border-box; margin-bottom: 20px;\"><strong style=\"box-sizing: border-box;\">Yêu cầu</strong><br style=\"box-sizing: border-box;\" />\r\n+Có kinh nghiệm, hiểu biết về các sản phẩm Mẹ và Bé...<br style=\"box-sizing: border-box;\" />\r\n+ Kỹ năng tìm kiếm thông tin trên Internet tốt.<br style=\"box-sizing: border-box;\" />\r\n+ Có hiểu biết cơ bản về FB, Mạng xã hội, SEO, Google Adwords là lợi thế. <br style=\"box-sizing: border-box;\" />\r\n+ Sử dụng thành thạo tin học văn phòng (Words, Excel) thành thạo, có khả năng đánh máy nhanh<br style=\"box-sizing: border-box;\" />\r\n+ Chăm chỉ, cẩn thận, có tinh thần trách nhiệm trong công việc<br style=\"box-sizing: border-box;\" />\r\n+ Nhanh nhẹn, nhiệt tình, ham học hỏi, hòa đồng, thân thiện<br style=\"box-sizing: border-box;\" />\r\n+ Có định hướng làm việc lâu dài</div>\r\n\r\n<div class=\"space_bottom_20\" style=\"box-sizing: border-box; margin-bottom: 20px;\"><strong style=\"box-sizing: border-box;\">Quyền lợi</strong><br style=\"box-sizing: border-box;\" />\r\n+ Được hưởng chế độ đãi ngộ đầy đủ, có ký hợp đồng và có bảo hiểm sau khi đã được nhận chính thức.<br style=\"box-sizing: border-box;\" />\r\n+ Lương tháng 13.<br style=\"box-sizing: border-box;\" />\r\n+ Được bao ăn trưa. <br style=\"box-sizing: border-box;\" />\r\n+ Làm việc trong môi trường chuyên nghiệp, đồng nghiệp thân thiện.<br style=\"box-sizing: border-box;\" />\r\n+ Môi trường làm việc năng động, hòa đồng. <br style=\"box-sizing: border-box;\" />\r\n+ Được nghỉ chủ nhật và nửa ngày thứ 7. + Ngoài ra còn nhiều đãi ngộ khác, trao đỗi kỹ khi phỏng vấn.</div>\r\n\r\n<div class=\"space_bottom_20\" style=\"box-sizing: border-box; margin-bottom: 20px;\"><strong style=\"box-sizing: border-box;\">Liên hệ</strong><br style=\"box-sizing: border-box;\" />\r\n+ Ứng Viên có nhu cầu, có thể liên lạc qua hotline: 0383061717</div>\r\n</div>\r\n', '', '62191118.jpg', NULL, 1, 1, 1557394739, 1557394739, '', '', '', '', '', '', 'Tuyển dụng', '', NULL, '', '', '', 'tuyen-dung', 1, NULL);
