(497, 129, 124, 0, 0, 0, '003684878350.jpg', '', 'Kem dưỡng trắng sáng da nâng tone cao cấp ', '', '', 'kem-duong-trang-sang-da-nang-tone-cao-cap', '386000', 0, '<p><strong>Công dụng: </strong>Tinh chất Súp lơ và Hạnh nhân giàu vitamin A, C, D, E… có trong kem giúp nâng tone, dưỡng da trắng sáng hơn, làm sạch, cung cấp độ ẩm dồi dào vào sâu bên trong da. Cải thiện nếp nhăn, chống lão hóa, tăng cường sức đề kháng, ngăn ngừa sự hình thành sắc tốt đen gây nám, ngăn ngừa mịn, nuôi dưỡng và cải thiện làn da. Với công thức kép Cauliflower extract có hiệu quả cao trong việc làm sáng da bằng cách cung cấp độ ẩm sâu. Sweet almont extract giảm sự mât độ ẩm và hấp thụ độ ẩm từ không khí, giúp da luôn mịn màng và trắng sáng.</p>\r\n\r\n<p><strong>Thành phần:</strong> Chiết xuất Súp lơ, Hạnh nhân, Niacinamide, vitamin A, C, D, E…</p>\r\n\r\n<p><strong>Cách dùng:</strong> Sau bước làm sạch lấy một lượng kem vừa phải rồi thoa nhẹ lên mặt, massage tới khi dưỡng chất thẩm thấu vào da. Dùng cả cho ngày và đêm.</p>\r\n\r\n<p><strong>Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p><strong>Hạn sử dụng:</strong> Xem trên sản phẩm.</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1545448742, 1549014257, 29, '', '', '', 0, '129,124', '', 0, 0, '', '', '', '', '', '', '', 'Kem dưỡng trắng sáng da nâng tone cao cấp  - COVERQUEEN CAULIFLOWER FACIAL BRIGHTENING CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '60g', '', '', 'Hàn Quốc'),
(498, 129, 131, 0, 0, 0, '476550945573.jpg', '', 'Nhũ tương dưỡng trắng hồng da tái sinh, phục hồi - chống lão hóa ', '', '', 'nhu-tuong-duong-trang-hong-da-tai-sinh-phuc-hoi-chong-lao-hoa', '596000', 0, '<p><strong>Công dụng:</strong> Nhũ tương chiết xuất từ vàng nguyên chất 24k kết hợp Hồng Sâm. Bổ sung đô ẩm nuôi dưỡng giúp gia khỏe mạnh. Chiết xuất từ vàng nguyên chất giúp da duy trì độ ẩm, săn chắc và đàn hồi, giảm độ gồ ghề cùng các vết sẹo rổ thâm được đẩy lùi. Ngoài ra còn đào thảo độc tố trong da, chống oxy hóa, kiểm soát nhờ tốt hơn, ngăn ngừa hình thành sắc tố đen gây thâm nám giúp da lấy lại độ bằng phẳng luôn trắng hồng mịn màng.</p>\r\n\r\n<p><strong>Thành phần: </strong>Vàng nguyên chất 24K, Hồng Sâm, thảo mộc, rau sam…</p>\r\n\r\n<p><strong>Cách dùng:</strong>  Sau khi sử dụng nước hoa hồng hoặc tinh chất dưỡng da, lấy một lượng nhũ tương vừa đủ thoa đều lên da, massage nhẹ nhàng tới khi dưỡng chất hấp thụ hết vào da.</p>\r\n\r\n<p><strong>Lưu ý:</strong> Dùng làm kem lót trước khi trang điểm.</p>\r\n\r\n<p><strong>Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát, tránh ánh nắng mặt trời.</p>\r\n\r\n<p><strong>HSD:</strong> Xem trên sản phẩm</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1545702058, 1548313569, 26, '', '', '', 0, '129,131', '', 0, 0, '', '', '', '', '', '', '', '', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '95ml', '', '', 'Hàn Quốc'),
(499, 129, 124, 0, 0, 0, '033726665950.jpg', '', 'Kem dưỡng trắng hồng (Vàng 24k nguyên chất - Hồng sâm)', '', '', 'kem-duong-trang-hong-vang-24k-nguyen-chat-hong-sam', '516000', 0, '<p><strong>Công dụng: </strong>Kem dưỡng tinh chất vàng nguyên chất 24K và Hồng Sâm bổ sung dưỡng chất nuôi dưỡng da, làm sáng bề mặt da. Phân tử vàng kết hợp với Hồng sâm, hạt hoa trà, oải hương… giúp nâng cơ mặt làm bề mặt của da săn chắc, tái tạo phục hồi, đẩy lùi nếp nhăn, chống oxy hóa, các vùng da xỉn màu và nám sạm sẽ trắng sáng hơn. Công thức thẩm thấu nhanh và khóa ẩm tốt trên da nhờ đó da hấp thụ tốt hơn các dưỡng chất cũng như tránh thẩm thấu ngược da sẽ luôn tươi sáng căng bóng tự nhiên…</p>\r\n\r\n<p><strong>Thành phần:</strong> Vàng nguyên chất 24K, nhân sâm đỏ, dầu hạt hoa trà, hoa oải hương…</p>\r\n\r\n<p><strong>Cách dùng:</strong> Sau khi sử dụng nhũ tương hoặc kem mặt, lấy một lượng kem vừa đủ thoa đều lên mặt, massage nhẹ nhàng tới khi dưỡng chất hấp thụ hết vào da.</p>\r\n\r\n<p><strong>Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p><strong>Hạn sử dụng:</strong> Xem trên sản phẩm</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1545702757, 1549023156, 16, '', '', '', 0, '129,124', '', 0, 0, '', '', '', '', '', '', '', 'KEM DƯỠNG TRẮNG  HỒNG, TÁI SINH, PHỤC HỒI, CHỐNG LÃO HÓA DA - LOVELY 24K GOLD RED GINSENG RICH CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '50g', '', '', 'Hàn Quốc'),
(500, 129, 127, 0, 0, 0, '003269633531.png', '', 'Kem dưỡng chống thâm - chống nhăn vùng mắt', '', '', 'kem-duong-chong-tham-chong-nhan-vung-mat', '386000', 0, '<p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Công dụng:</strong> Với các thành phần thiên nhiên kết hợp Beta-glucan từ Bơ hạt mỡ giúp xóa tan các vết nhăn, vết chân chim đuôi mắt. Chức năng kích thích khả năng miễn dịch chống lão hóa, làm dịu mát, thẩm thấu sâu nhẹ nhàng đẩy lùi các vết thâm, ngăn ngừa quá trình hình thành mụn thịt vùng quanh mắt. Ngoài ra với khả năng cung cấp độ ẩm cao giúp da vùng mắt không khô ráp, luôn săn chắc, sáng trắng tự nhiên đầy sức sống.</span><br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Thành phần:</strong> Bơ hạt mỡ, các loại dầu thiên nhiên,…</span><br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\">Cách dùng: Sau khi sử dụng sữa dưỡng hoặc tinh chất, lấy một lượng kem vừa đủ thoa đều lên vùng da quanh mắt, massage nhẹ nhàng tới khi dưỡng chất hấp thụ hết vào da.</span><br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</span><br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\" />\r\n<span style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>HSD:</strong> Xem trên sản phẩm.</span></p>\r\n', '', '', '', '', '', '', '', 1, 1, 1545702923, 1549104045, 16, '', '', '', 0, '129,127', '', 0, 0, '', '', '', '', '', '', '', 'Kem dưỡng chống thâm, chống nhăn vùng mắt - CELLUNA TROUBLE SHOOTER EYE CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '130ml', '', '', 'Hàn Quốc'),
(501, 129, 124, 0, 0, 0, '365773409995.jpg', '', 'Kem dưỡng da ban ngày Celluna', '', '', 'kem-duong-da-ban-ngay-celluna', '386000', 0, '<p><strong>Công dụng: </strong>Nuôi dưỡng, cung cấp nước, khóa ẩm cho làn da, giúp da luôn mềm mại, mịn màng, không bị khô ráp. Các vitamin có trong dầu tự nhiên giúp se khít lỗ chân lông xóa mở các vết thâm nám, sạm đen, vết nhăn trên da. Ngoài ra kem còn có tác dụng bảo vệ da khỏi những tác nhân xấu từ môi trường bên ngoài, bụi bẩn, ô nhiễm không khí, ánh nắng mặt trời và một số tác nhân gây hại có trong kem và phấn trang điểm. Cho làn da của bạn luôn trắng sáng tự nhiên.</p>\r\n\r\n<p><strong>Thành phần:</strong> Axit Hyaluronic, dầu tự nhiên, vitamin và bơ hạt mỡ.</p>\r\n\r\n<p><strong>Cách dùng:</strong> Sau bước làm sạch lấy một lượng kem vừa đủ xoa đều lên mặt, massage nhẹ nhàng cho kem thấm hết vào da.</p>\r\n\r\n<p><strong>Thể tích thực: </strong>40g</p>\r\n\r\n<p><strong>Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p><strong>Hạn sử dụng:</strong> Xem trên sản phẩm</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1545703131, 1549104859, 56, '', '', '', 0, '129,124', '', 0, 0, '', '', '', '', '', '', '', 'Kem dưỡng da ban ngày Celluna - DAY 2 DAY CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '40g', '', '', 'Hàn Quốc'),
(503, 129, 141, 0, 0, 0, '802204393365.jpg', '', 'Nước hoa hồng (vàng 24k nguyên chất – hồng sâm)', '', '', 'nuoc-hoa-hong-vang-24k-nguyen-chat-hong-sam', '596000', 0, '<div><strong>Công dụng:</strong> Làm sạch sâu cân bằng độ PH trên da, thu nhỏ lổ chân long. Các phân tử vàng thẩm thấu nhanh, giúp tuần hoàn máu, tăng cường hệ miễn dịch. Đồng thpời hình thành màng dưỡng ẩm bảo vệ da giúp làm trắng, cải thiện nếp nhăn cho cấu trúc nền của da luôn chắc khỏe, sáng mịn.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau khi rửa mặt sạch, lấy một lượng nước hoa hồng vừa đủ nhẹ nhàng thoa đều lên mặt, vỗ nhẹ để thấm sâu vào da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần: </strong>Vàng 24k, hồng sâm, trà xanh, bạc hà …</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích:</strong> 95ml</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất: </strong>Hàn Quốc</div>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', '', '', 1, 1, 1546576304, 1549022664, 42, '', '', '', 0, '129,141', '', 0, 0, '', '', '', '', '', '', '', 'NƯỚC HOA HỒNG DƯỠNG TRẮNG HỒNG TÁI SINH, PHỤC HỒI, CHỐNG LÃO HÓA DA - LOVELY 24K GOLD RED GINSENG SKIN TONER', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '95ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(502, 129, 124, 0, 0, 0, '246645469222.jpg', '', 'Kem dưỡng da ban đêm Celluna', '', '', 'kem-duong-da-ban-dem-celluna', '386000', 0, '<p><strong>Công dụng: </strong>Cung cấp dưỡng chất và độ ẩm tận sâu trong da giúp tăng cường thúc đẩy tái tạo tế bào, bổ sung collagen ngăn ngừa nám, lão hóa. Tạo hàng rào bảo vệ tự nhiên, làm dịu da, loại bỏ các tác động của hóa chất có trong mỹ phẩm trang điểm. Giúp da luôn chắc khỏe và trắng hồng rạng rỡ.</p>\r\n\r\n<p><strong>Thành phần:</strong> Dầu hạt Macadamia, dầu tự nhiên, vitamin và bơ hạt mỡ.</p>\r\n\r\n<p><strong>Cách dụng:</strong> Bước cuối cùng của chăm sóc da, lấy lượng kem vừa đủ thoa đều lên mặt. Masage nhẹ nhàng cho kem thẩm thấu hết vào da.</p>\r\n\r\n<p><strong>Thể tích thực:</strong> 40g</p>\r\n\r\n<p><strong>Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p><strong>Hạn sử dụng:</strong> Xem trên sản phẩm</p>\r\n\r\n<p><strong>Xuất xứ: </strong>Hàn Quốc</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1545838700, 1549104908, 45, '', '', '', 0, '129,124', '', 0, 0, '', '', '', '', '', '', '', 'Kem dưỡng da ban đêm Celluna - NIGHT 2 NIGHT CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '40g', '', '', 'Hàn Quốc'),
(504, 129, 141, 0, 0, 0, '108238486008.jpg', '', 'Nước cân bằng dưỡng - phục hồi da hư tổn (hoa lavender)', '', '', 'nuoc-can-bang-duong-phuc-hoi-da-hu-ton-hoa-lavender', '726000', 0, '<div><strong>Công dụng:</strong> Làm sạch sâu cân bằng độ PH trên da, thu nhỏ lổ chân long, dưỡng ẩm tự nhiên và làm dịu da. Giúp phục hồi làm da bị hư tổn, chống lão hóa, nám, tàn nhang. Làn da luôn được làm sạch và dưỡng ẩm giúp hấp thu các chất dinh dưỡng ở các bước dưỡng da tiếp theo</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau khi rửa mặt sạch, lấy một lượng nước hoa hồng vừa đủ nhẹ nhàng thoa đều lên mặt, vỗ nhẹ để thấm sâu vào da. Sử dụng cho tất cả mọi loại da kể cả làn da nhạy cảm nhất, phụ nữ mang thai.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần: </strong>Chiết xuất 100% từ thiên nhiên, sử dụng tinh chất hoa oải hương.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích:</strong> 100g</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất: </strong>jajacnanum., Co LTD – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546576483, 1549023583, 16, '', '', '', 0, '129,141', '', 0, 0, '', '', '', '', '', '', '', 'NƯỚC CÂN BẰNG DƯỠNG, PHỤC HỒI DA HƯ TỔN - JAJAC NANUM LAVENDER 95 TONER', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '100g', '', '', 'jajacnanum., Co LTD – Hàn Quốc'),
(505, 129, 141, 0, 0, 0, '044714437738.png', '', 'Nước hoa hồng kháng viêm cho da mụn', '', '', 'nuoc-hoa-hong-khang-viem-cho-da-mun', '416000', 0, '<div><strong>Công dụng:</strong> Làm mềm da, giúp da nhanh chóng hấp thu dưỡng chất. Với công thức pha trộn riêng biệt, giúp da luôn có độ PH ở mức chuẩn cân bằng (từ 4,5 đến 6), luôn có cảm giác dịu nhẹ cho da, thu nhỏ lỗ chân long, giảm thiểu các vấn đề về mụn trứng cá, lấy đi tế bào chết, loại bỏ mụn ẩn, đẩy lùi các vết thâm, làm liền sẹo. Làn da luôn được cảm giác sảng khoái, sáng mịn tự nhiên.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau khi rửa mặt sạch, lấy một lượng nước hoa hồng vừa đủ nhẹ nhàng thoa đều lên mặt, vỗ nhẹ để thấm sâu vào da. </div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần: </strong>Chiết xuất lô hội, trà xanh, rau má, witch hazel, galactomyces …</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích:</strong> 130ml</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Công ty Doosun – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546576701, 1549103181, 35, '', '', '', 0, '129,141', '', 0, 0, '', '', '', '', '', '', '', 'Nước hoa hồng dịu nhẹ, kháng viêm cho da mụn - CELLUNA TROUBLE SHOOTER SKIN TONER', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '130ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(506, 129, 141, 0, 0, 0, '755706246103.jpg', '', 'Nước chăm sóc da làm sạch - kiểm soát dầu - điều tiết bã nhờn', '', '', 'nuoc-cham-soc-da-lam-sach-kiem-soat-dau-dieu-tiet-ba-nhon', '556000', 0, '<div><strong>Công dụng:</strong> Giúp làm sạch sâu, kiểm soát tuyến bã nhờn, giúp cân bằng làn da, giúp tế bào da không bị phá hủy, giúp làm trắng sáng da, tăng độ miễn dịch, làm dịu nhẹ cho da nhạy cảm, đặc biệt khắc phục viêm nhiễm sung ngứa da và giảm mụn ẩn bên trong da. Đặc biệt, các thành phần tự nhiên giúp tăng cường hệ thống miễn dịch, chống ôxy hóa, giúp phục hồi và chống lão hóa da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng: </strong>Sau khi rửa mặt sạch, lấy một lượng vừa đủ nhẹ nhàng thoa đều lên mặt, massage nhẹ nhàng đến khi dưỡng chất thấm hết vào da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> Gừng, hoa oải hương, rễ cây cam thảo, ngũ vị tử (quả omija)</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích: </strong>130ml</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546576836, 1549104184, 39, '', '', '', 0, '129,141', '', 0, 0, '', '', '', '', '', '', '', 'Nước chăm sóc da làm sạch, kiểm soát dầu, điều tiết bã nhờn - WATERING THE FLOWERS LAVENDER WATER SKIN', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '130ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(507, 129, 131, 0, 0, 0, '360099716243.jpg', '', 'Nhũ tương (vàng 24k nguyên chất – hồng sâm)', '', '', 'nhu-tuong-vang-24k-nguyen-chat-hong-sam', '596000', 0, '<div><strong>Công dụng:</strong> Bổ sung độ ẩm, nuôi dưỡng giúp da khỏe mạnh, duy trì độ ẩm, săn chắc và đàn hồi, giảm độ gồ ghề, các vết sẹo rổ thâm được đẩy lùi. Ngoài ra còn đào thải độc tố trên da, chống ôxy hóa, kiểm soát nhờn tốt hơn, ngăn ngừa hình thành sắc tố đen gây nám, sạm da, giúp da lấy lại độ bằng phẳng, luôn trắng hồng mịn màng.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng: </strong>Sau khi sử dụng nước hoa hồng, tinh chất, lấy một lượng dưỡng chất vừa đủ, nhẹ nhàng thoa đều lên mặt, vỗ nhẹ để toàn bộ dưỡng chất thấm sâu vào da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần: </strong>Vàng 24k, hồng sâm, thảo mộc, rau sam…</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích: </strong>95ml</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Công ty Doosun – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546577060, 1549022769, 16, '', '', '', 0, '129,131', '', 0, 0, '', '', '', '', '', '', '', 'NHŨ TƯƠNG DƯỠNG TRẮNG HỒNG TÁI SINH, PHỤC HỒI, CHỐNG LÃO HÓA DA - LOVELY 24K GOLD RED GINSENG EMULSION', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '95ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(508, 129, 131, 0, 0, 0, '568886184764.jpg', '', 'Nhũ tương dưỡng - phục hồi da hu tổn (hoa lavender)', '', '', 'nhu-tuong-duong-phuc-hoi-da-hu-ton-hoa-lavender', '756000', 0, '<div><strong>Công dụng:</strong> Thẩm thấu sâu vào da mà không gây bít các lổ, giữ ẩm cho da cao, giúp đào thải độc tố, kháng viêm, loại bỏ mụn, ngăn ngừa lão hóa, nám, tàn nhang. Phục hồi làn da bị hư tổn, kiểm soát bã nhờn, làm dịu da. Duy trì sự cân bằng của dầu trong da, giúp da đàn hồi và tràn đầy sức sống. Có thể thay thế kem lót trước khi trang điểm.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau bước sử dụng nước hoa hồng, tinh chất, lấy một lượng vừa đủ dưỡng chất thoa đều lên mặt, massage tới khi dưỡng chất thẩm thấu vào da. Thích hợp cho mọi loại da kể cả da nhạy cảm nhất, phụ nữ mang thai và da bị tổn thương.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần: </strong>Chiết xuất 100% từ thiên nhiên, sử dụng tinh chất hoa oải hương, dầu jojoba và dầu thực vật.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích:</strong> 100g</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> jajacnanum., Co LTD – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546577158, 1549023342, 20, '', '', '', 0, '129,131', '', 0, 0, '', '', '', '', '', '', '', 'NHŨ TƯƠNG DƯỠNG, PHỤC HỒI DA HƯ TỔN - JAJAC NANUM LAVENDER 95 EMULSION', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '100g', '', '', 'jajacnanum., Co LTD – Hàn Quốc'),
(509, 129, 125, 0, 0, 0, '504695780909.png', '', 'Sữa dưỡng mềm da - sạch bã nhờn - giảm mụn', '', '', 'sua-duong-mem-da-sach-ba-nhon-giam-mun', '476000', 0, '<div><strong>Công dụng:</strong> Nhẹ nhàng dưỡng ẩm bề mặt da, giúp thu nhỏ lỗ chân long, kiểm soát bã nhờn tốt hơn, lấy đi các nhân mụn, se khít lỗ chân long.Ngoài ra, thành phần tự nhiên còn giúp bảo vệ da khỏi các tác nhân độc hại từ môi trường, ngăn ngừa mục ẩn và nám sạm, đẩy lùi vết thâm, tăng cường sức đề kháng cho da. Làm da luôn sạch sẽ và khỏe mạnh.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau bước sử dụng nước hoa hồng, tinh chất, lấy một lượng vừa đủ dưỡng chất thoa đều lên mặt, massage tới khi dưỡng chất thẩm thấu vào da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần: </strong>Chiết xuất lô hội, trà xanh, rau má, witch hazel, galactomyces, việt quất  …</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích: </strong>130ml</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Công ty Doosun – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546577747, 1549103785, 13, '', '', '', 0, '129,125', '', 0, 0, '', '', '', '', '', '', '', 'Sữa dưỡng mềm da, sạch bã nhờn, giảm mụn - CELLUNA TROUBLE SHOOTER EMMULSION', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '130ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(510, 129, 125, 0, 0, 0, '244259176180.jpg', '', 'Dưỡng chất kháng khuẩn - giảm tiết dầu - sạch bã nhờn', '', '', 'duong-chat-khang-khuan-giam-tiet-dau-sach-ba-nhon', '556000', 0, '<div><strong>Công dụng:</strong> Giúp tái tạo lớp màng tự nhiên bảo vệ da, kiểm soát tuyến bã nhờn và giảm thiểu tối đa lượng dầu thừa, giúp tăng độ ẩm, kháng viêm, nhiễm khuẩn da, mờ sẹo rỗ, làm mát và dịu làn da, làm se khít lỗ chân long. Đồng thời, cung cấp dưỡng chất và độ ẩm cho da, giúp giảm nhanh các vấn đề về mụn trứng cá, cân bằng dầu cho da đặc biệt ở vùng chữ T, tái tạo và cải thiện sắc tố da. Làn da sẽ trở nên sáng khỏe, sạch dầu, mịn màng tự nhiên.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau khi sử dụng nước chăm sóc da, lấy một lượng vừa đủ thoa đều lên mặt, massage nhẹ nhàng đến khi dưỡng chất thấm hết vào da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> Dầu jojoba, bơ hạt mỡ, rau má, trà xanh, hoa mẫu đơn.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích:</strong> 130ml</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546578109, 1549104328, 13, '', '', '', 0, '129,125', '', 0, 0, '', '', '', '', '', '', '', 'Dưỡng chất kháng khuẩn, giảm tiết dầu, sạch bã nhờn - WATERING THE FLOWERS JOJOBA OIL LOTION', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '130ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(511, 129, 114, 0, 0, 0, '639213548750.jpg', '', 'Tinh chất (vàng 24k nguyên chất – hồng sâm)', '', '', 'tinh-chat-vang-24k-nguyen-chat-hong-sam', '596000', 0, '<div><strong>Công dụng: </strong>Bổ sung dưỡng chất, làm tăng cường sức sống cho da, kích hoạt tế bào da và thúc đẩy quá trình sản sinh collagen, elastin. Tái tạo cấu trúc da, tăng cường độ đàn hồi cho da, chống lão hóa, ôxy hóa, chống giãn mao mạch, ngăn ngừa sự hình thành nám, tàn nhang và mụn ẩn, chảy xệ, mang lại làn da trắng hồng căng mịn.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau bước sử dụng nước hoa hồng, lấy một lượng vừa đủ dưỡng chất thoa đều lên mặt, massage tới khi dưỡng chất thẩm thấu vào da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần: </strong>Vàng 24k, hồng sâm, thảo mộc, rau sam, bạc hà…</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích: </strong>95ml</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Công ty Doosun – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546578446, 1549022848, 30, '', '', '', 0, '129,114', '', 0, 0, '', '', '', '', '', '', '', ' TINH CHẤT DƯỠNG TRẮNG  HỒNG. TÁI SINH, PHỤC HỒI, CHỐNG LÃO HÓA DA - LOVELY 24K GOLD RED GINSENG ESSENCE', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '95ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(512, 129, 114, 0, 0, 0, '451518365884.jpg', '', 'Tinh chất trị liệu - phục hồi da hư tổn (hoa lavender)', '', '', 'tinh-chat-tri-lieu-phuc-hoi-da-hu-ton-hoa-lavender', '856000', 0, '<div><strong>Công dụng: </strong>Cung cấp độ ẩm, giúp hấp thu vào sâu trong da mà không gây dính nhớp, duy trì làn da mềm mại trong thời gian dài, giúp chống lão hóa, đào thải độc tố và ngăn chặn sự hình thành sắc tố melanin, hình thành màng bảo vệ da, cung cấp dưỡng chất cho da, mang lại làn da khỏe mạnh, tur7ờng tồn theo thời gian.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau bước sử dụng nước hoa hồng, lấy một lượng vừa đủ dưỡng chất thoa đều lên mặt, massage tới khi dưỡng chất thẩm thấu vào da. Thích hợp cho mọi loại da kể cả da nhạy cảm nhất, phụ nữ mang thai và da bị tổn thương.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> Chiết xuất 100% từ thiên nhiên, sử dụng tinh chất hoa oải hương, tinh dầu jojoba, dầu thực vật, dầu maru la có lượng vitamin C nhiều gấp 4 lần vitamin có trong cam</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích:</strong> 50g</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> jajacnanum., Co LTD – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546578558, 1549023528, 12, '', '', '', 0, '129,114', '', 0, 0, '', '', '', '', '', '', '', 'TINH CHẤT TRỊ LIỆU, PHỤC HỒI DA HƯ TỔN - JAJAC NANUM LAVENDER 95 MARULA HEALING ESSENCE', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '50g', '', '', 'jajacnanum., Co LTD – Hàn Quốc'),
(513, 129, 126, 0, 0, 0, '042174686418.png', '', 'Huyết thanh thải độc tố - giảm mụn - khắc phục sẹo rỗ', '', '', 'huyet-thanh-thai-doc-to-giam-mun-khac-phuc-seo-ro', '416000', 0, '<div><strong>Công dụng: </strong>Thẩm thấu sâu vào lớp dưới cùng của da, kích thích sản sinh tế bào mới, giúp bề mặt da luôn bằng phẳng, mịn màng, mờ sẹo, hình thành lớp màng bảo vệ da. Đào thải độc tố từ sâu bên trong ngăn chặn quá trình ức chế tuyến bã nhờn, loại bỏ mụn ẩn, mụn đầu đen. Ngoài ra, các thành phần tự nhiên sau khi thẩm thấu giúp da không bị kích ứng, làm mờ các vết thâm do mụn gây ra, ngăn ngừa nám sạm, giảm thiểu nếp nhăn giúp da săn chắc, trắng hồng.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau bước sử dụng nước hoa hồng, lấy một lượng vừa đủ dưỡng chất thoa đều lên mặt, massage tới khi dưỡng chất thẩm thấu vào da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> Chiết xuất lô hội, trà xanh, rau má, witch hazel, galactomyces, camellia  …</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích:</strong> 130ml</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất: </strong>Công ty Doosun – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546578715, 1549103643, 18, '', '', '', 0, '129,126', '', 0, 0, '', '', '', '', '', '', '', 'Huyết thanh phục hồi, thải độc tố, giảm mụn, khắc phục sẹo rỗ - CELLUNA TROUBLE SHOOTER SERUM', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '130ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(514, 129, 124, 0, 0, 0, '279021518691.jpg', '', 'Kem dưỡng trắng hồng da (vàng 24k nguyên chất – hồng sâm)', '', '', 'kem-duong-trang-hong-da-vang-24k-nguyen-chat-hong-sam', '516000', 0, '<div><strong>Công dụng:</strong> Bổ sung dưỡng chất, làm sáng bề mặt da, giúp nâng cơ mặt làm bề mặt da săn chắc, tái tạo phục hồi, đẩy lùi nếp nhăn, chống ôxy hóa. Các vùng da xỉn màu và nám xạm sẽ trắng sáng hơn. Công thức thẩm thấu nhanh và khóa ẩm tốt trên da nhờ đó da hấp thụ tốt hơn các dưỡng chất cũng như tránh thẩm thấu ngược, da sẽ luôn tươi sáng, căng bòng tự nhiên. </div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau bước sử dụng nhũ tương, kem mắt, lấy một lượng kem vừa đủ thoa đều lên mặt, massage tới khi dưỡng chất thẩm thấu vào da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> Vàng 24k, nhân sâm đỏ, dầu hạt hoa trà, hoa oải hương…</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích</strong><strong>: </strong>50g</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Công ty Doosun – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546578884, 1548312973, 11, '', '', '', 0, '129,124', '', 0, 0, '', '', '', '', '', '', '', '', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '50g', '', '', 'Công ty Doosun – Hàn Quốc'),
(515, 129, 124, 0, 0, 0, '186830518307.jpg', '', 'Kem phục hồi, dưỡng da hư tổn (hoa lavender)', '', '', 'kem-phuc-hoi-duong-da-hu-ton-hoa-lavender', '856000', 0, '<div><strong>Công dụng:</strong> Ngăn chặn lão hóa, vết sạm, đốm nâu, nám, kháng viêm, kháng khuẩn, ức chế tăng tiết nhờn, loại bỏ mụn, … hình thành màng bảo vệ da và cung cấp dưỡng chất cho da. Phục hồi làn da hư tổn, giúp da có sự đàn hồi, cung cấp độ ẩm cho da mà không gây bít các lỗ chân long, bảo vệ làn da nhạy cảm và mang lại làn da tươi sáng, mịn màng.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau bước sử dụng nhũ tương, lấy một lượng kem vừa đủ thoa đều lên mặt, massage tới khi dưỡng chất thẩm thấu vào da. Thích hợp cho mọi loại da kể cả da nhạy cảm nhất, phụ nữ mang thai và da bị tổn thương.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> Chiết xuất 100% từ thiên nhiên, sử dụng tinh chất hoa oải hương, tinh dầu jojoba, dầu thực vật, dầu maru la có lượng vitamin C nhiều gấp 4 lần vitamin có trong cam, dầu rosehill có lượng vitamin C gấp 60 lần vitamin có trong chanh, dầu argan…</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích: </strong>50g</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> jajacnanum., Co LTD – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546579018, 1549023430, 20, '', '', '', 0, '129,124', '', 0, 0, '', '', '', '', '', '', '', 'KEM DƯỠNG, PHỤC HỒI DA HƯ TỔN - JAJAC NANUM LAVENDER 95 DAILY CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '50g', '', '', 'jajacnanum., Co LTD – Hàn Quốc'),
(516, 129, 124, 0, 0, 0, '148663179545.png', '', 'Kem dưỡng trắng làm mềm da - giảm mụn - mờ thâm sẹo', '', '', 'kem-duong-trang-lam-mem-da-giam-mun-mo-tham-seo', '416000', 0, '<div><strong>Công dụng: </strong>Giúp bề mặt da săn chắc, mềm mại, làm se đầu mụn và nhẹ nhàng lấy đi các nhân mụn, phục hồi các hư tổn về da như đốm thâm nám, thâm sẹo, tàn nhang, đồi mồi, bảo vệ da tối đa khỏi các tác động độc hại của môi trường bên ngoài. Tăng cường độ đàn hồi, làm da trắng sáng, tươi trẻ, thích nghi với mọi điều kiện khí hậu và môi trường bên ngoài.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng: </strong>Sau bước sử dụng nước hoa hồng, lấy một lượng vừa đủ dưỡng chất thoa đều lên mặt, massage tới khi dưỡng chất thẩm thấu vào da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> Chiết xuất lô hội, trà xanh, rau má, witch hazel, galactomyces, betaglucan, các loại dầu tự nhiên (olive oil, grape oil)…</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thể tích:</strong> 130ml</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất: </strong>Công ty Doosun – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546579261, 1549103881, 15, '', '', '', 0, '129,124', '', 0, 0, '', '', '', '', '', '', '', 'Kem dưỡng trắng làm mềm da, giảm mụn, mờ thâm sẹo - CELLUNA TROUBLE SHOOTER MOISTURIZING CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '130ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(517, 129, 127, 0, 0, 0, '123118873702.jpg', '', 'Kem chống nhăn, thâm vùng mắt (vàng 24k nguyên chất – hồng sâm)', '', '', 'kem-chong-nhan-tham-vung-mat-vang-24k-nguyen-chat-hong-sam', '516000', 0, '<div>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; font-weight: 700;\">Công dụng: </span>Kem dưỡng vùng mắt tinh chất  vàng nguyên chất  24k và hồng sâm. Tăng cường dưỡng chất nuôi dưỡng da đẩy lùi quầng thầm mắt cho da khỏe mạnh. Các phân tử vàng nguyên chất kết hợp  hồng sâm có công dụng tuyệt vời cải thiện nếp nhăn, lấy lại độ đàn hồi cho da quanh mắt luôn căng mịn. Công thức kem mềm mại thẩm thấu ngay vào da đem lại cho vùng da khóe mắt luôn tràn đầy sức sống</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; font-weight: 700;\">Thành phần:</span> Vàng 24K, hồng sâm, thảo mộc thiên nhiên,…</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; font-weight: 700;\">Cách dùng:</span> Sau khi sử dụng nhũ tương hoặc tinh chất, lấy một lượng kem vừa đủ thoa đều lên vùng da quanh mắt, massage nhẹ nhàng tới khi dưỡng chất hấp thụ hết vào da.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; font-weight: 700;\">Bảo quản:</span> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; font-weight: 700;\">HSD:</span> Xem trên sản phẩm.</p>\r\n</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546580218, 1549023144, 19, '', '', '', 0, '129,127', '', 0, 0, '', '', '', '', '', '', '', 'KEM DƯỠNG, CHỐNG NHĂN THÂM QUẦNG MẮT - LOVELY 24K GOLD RED GINSENG EYE CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', 'Công ty Doosun – Hàn Quốc'),
(518, 118, 137, 0, 1, 0, '719492405931.jpg', '', 'Thanh chống nắng cao cấp, kiểm soát nhờn bảo vệ 2 lần', '', '', 'thanh-chong-nang-cao-cap-kiem-soat-nhon-bao-ve-2-lan', '496000', 0, '<div><strong>Công dụng:</strong> Công thức double tạo lớp màng nhân đôi khả năng bảo vệ da khỏi tác hại của tia cực tím UVA, UVB. Tác dụng vượt trội làm trắng, chống nhăn, kiểm soát dầu. Ngoài ra, sản phẩm còn có tác dụng giữ ẩm, duy trì sức sống và sự khỏe mạnh của da. Thiết kế nhỏ gọn, dễ dàng sử dụng mọi lúc mọi nơi.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng: </strong>Sau bước làm sạch và dưỡng da, thoa nhẹ nhàng và đều theo kết cấu da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần: </strong>Chiết xuất từ 100 loại thực vật tự nhiên như tinh chất hoa oải hương, hoa cúc trắng, hoa trà, bạc hà …. Cùng 4 hợp chất nuôi dưỡng da đặc biệt Anti-Thermarin, Sepic, Botaniceuticalplus-10, beautiful herb story.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Trọng lượng: </strong>20g</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Công ty Doosun – Hàn Quốc\r\n\r\n<ul style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\">\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; line-height: 24px; list-style: square inside none;\">Đây là sản phẩm chống nắng 100 % tự nhiên . Bảo vệ da gấp 2 lần so với những loại chống nắng thông thường.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; line-height: 24px; list-style: square inside none;\">Dạng thanh rất tiện ích khi sử dụng</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; line-height: 24px; list-style: square inside none;\">Sản phẩm dành cho Gia Đình : xóa tan lỗi lo về nắng</li>\r\n</ul>\r\n</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546614814, 1549014646, 16, '', '', '', 0, '118,137', '', 0, 0, '', '', '', '