(519, 118, 137, 0, 0, 0, '701358300516.jpg', '', 'Kem chống nắng dưỡng da tinh chất vàng', '', '', 'kem-chong-nang-duong-da-tinh-chat-vang', '336000', 0, '<p background-color:=\"\" font-size:=\"\" roboto=\"\" style=\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: \"><span style=\"box-sizing: border-box; font-weight: bolder;\">Công dụng</span>: Được chiết xuất từ tinh chất và các loại thảo dược tự nhiên. Tinh chất chống nắng bảo vệ làn da khỏi tia UV, Tái tạo, dưỡng ẩm và giúp làm trắng da. Sản phẩm giúp làn da của bạn vừa được bảo vệ vừa được nuôi dưỡng trở nên sáng mịn.</p>\r\n\r\n<p background-color:=\"\" font-size:=\"\" roboto=\"\" style=\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: \"><span style=\"box-sizing: border-box; font-weight: bolder;\">Cách dùng</span>: Sau bước chăm sóc da, lấy một lượng vừa đủ, nhẹ nhàng tán đều theo kết cấu da.</p>\r\n\r\n<p background-color:=\"\" font-size:=\"\" roboto=\"\" style=\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; color: rgb(10, 10, 10); font-family: \"><span style=\"box-sizing: border-box; font-weight: bolder;\">Thành phần</span>: Chiết xuất từ tinh chất vàng, hoa sen, nấm sanghwang, dầu hạt cây rum, và các chiết xuất từ thảo mộc phương Đông.</p>\r\n\r\n<p background-color:=\"\" font-size:=\"\" open=\"\" style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: \">Trọng lượng: 30g</p>\r\n\r\n<p background-color:=\"\" font-size:=\"\" open=\"\" style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: \">Bảo quản: Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p background-color:=\"\" font-size:=\"\" open=\"\" style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: \">HSD: Xem trên bao bì.</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1546614956, 1549013953, 15, '', '', '', 0, '118,137', '', 0, 0, '', '', '', '', '', '', '', 'Kem chống nắng dưỡng da tinh chất vàng - COVERQUEEN ORIENTAL GOLD ESSENTIAL SUN BASE SPF50 PA++\r\n', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '30g', '', '', 'Công ty Doosun – Hàn Quốc'),
(520, 118, 137, 0, 0, 0, '387982285568.jpg', '', 'Kem chống nắng thảo dược SPF 50+, PA+++', '', '', 'kem-chong-nang-thao-duoc-spf-50-pa', '256000', 0, '<div>\r\n<div><strong>Công dụng:</strong> Chống nắng, bảo vệ da không bị tổn thương bởi tia cực tím mạnh, dưỡng trắng, cải thiện nếp nhăn.Đồng thời tăng cường dưỡng ẩm cho da, làm dịu mát làn da, tăng cường bài tiết đàn hồi cho da, ức chế bã nhờn, tái tạo và chống oxy hóa. Giúp trắng da, nâng tone cho da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau bước làm sạch và dưỡng da, thoa nhẹ nhàng và đều theo kết cấu da. Dùng trước khi ra ngoài 30 phút.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> hoa cúc Nacinamide, adenosine, thảo dược, lô hội, dầu hạt Jojoba</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Trọng lượng:</strong> 30g</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Hàn Quốc</div>\r\n</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546615071, 1549015770, 36, '', '', '', 0, '118,137', '', 0, 0, '', '', '', '', '', '', '', 'Kem chống nắng thảo dược SPF 50+, PA+++ - SUN FIGHTER HERB', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '30g', '', '', 'Công ty Doosun – Hàn Quốc'),
(521, 118, 137, 0, 1, 0, '241395493787.jpg', '', 'Kem chống nắng bạc hà SPF 50+, PA+++', '', '', 'kem-chong-nang-bac-ha-spf-50-pa', '256000', 0, '<div><strong>Công dụng:</strong> Chống nắng, bảo vệ da không bị tổn thương bởi tia cực tím mạnh, dưỡng trắng, cải thiện nếp nhăn.Đồng thời tăng cường dưỡng ẩm cho da, làm dịu mát làn da, tăng cường bài tiết đàn hồi cho da, ức chế bã nhờn, tái tạo và chống oxy hóa. Giúp trắng da, nâng tone cho da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Sau bước làm sạch và dưỡng da, thoa nhẹ nhàng và đều theo kết cấu da. Dùng trước khi ra ngoài 30 phút.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> hoa cúc Nacinamide, adenosine, bạc hà, lô hội, dầu hạt Jojoba</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Trọng lượng:</strong> 30g</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546615182, 1549015737, 39, '', '', '', 0, '118,137', '', 0, 0, '', '', '', '', '', '', '', 'Kem chống nắng bạc hà SPF 50+, PA+++ - SUN FIGHTER COOL MINT', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '30g', '', '', 'Công ty Doosun – Hàn Quốc');
