(522, 121, 133, 0, 0, 0, '888509306083.jpg', '', 'Gel tẩy tế bào chết làm sáng da - sạch mụn', '', '', 'gel-tay-te-bao-chet-lam-sang-da-sach-mun', '186000', 0, '<div>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Công dụng:</strong> Gel tẩy tế bào chết được chiết xuất từ các thành phần thiên nhiên và trà xanh nhẹ nhàng làm sạch da, lấy đi các tế bào chết và các tạp chất bụi bẩn trên da mà không gây kích ứng da. Đào thải độc tố trong da, cấp ẩm cho da, cân bằng và kiểm soát nhờn ngăn ngừa sự hình thành mụn. Làm tăng hiệu quả thẩm thấu các bước dưỡng da tiếp theo, cho làn da luôn mềm mại, trắng sáng và mịn màng hơn.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\">Dùng cho mọi loại da, tốt cho da mụn và da nhạy cảm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Thành phần:</strong> Trà xanh, rau má, các nguyên liêu tự nhiên,…</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Cách dùng:</strong> Sau khi làm sạch mặt và lau sạch nước trên mặt, lấy một lượng thích hợp và áp dụng đồng đều trên toàn bộ khuôn mặt ngoại trừ mắt và miệng. Nhẹ nhàng massage theo kết cấu da từ bên trong ra ngoài. Rồi rửa sạch lại với nước ấm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\">Chỉ nên sử dụng 2-3 lần trong một tuần.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">HSD:</strong> Xem trên sản phẩm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Thể tích thực:</strong> 100g</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Xuất xứ</strong>: Hàn Quốc</p>\r\n</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546615387, 1549105304, 33, '', '', '', 0, '121,133', '', 0, 0, '', '', '', '', '', '', '', 'Gel tẩy tế bào chết làm sáng da, sạch mụn - CELLUNA GREEN TEA PEELING GEL', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '120g', '', '', 'Công ty Doosun – Hàn Quốc'),
(523, 121, 134, 0, 0, 0, '332308120010.jpg', '', 'Nước tẩy trang trà xanh Celluna', '', '', 'nuoc-tay-trang-tra-xanh-celluna', '196000', 0, '<div>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Công dụng:</strong> Nước tẩy trang trà xanh có chức năng rửa sạch lớp trang điểm kể cả các sản phẩm chống trôi, chống lem, các bụi khí bẩn độc hại do ô nhiểm môi trường bám trên bề mặt da mà không gây kích ứng tổn hại cho làn da. Được chiết xuất từ trà xanh  làm dịu da, ổn định da giúp da luôn sáng khỏe và ngăn ngừa sự hình thành mụn, viêm da.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\">Dùng cho mọi loại da và mắt môi.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Thành phần:</strong> Trà xanh, Thảo dược,…</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Cách dùng:</strong> Lấy một lượng thích hợp nước tẩy trang ra bông tẩy trang, sau đó nhẹ nhàng lau khắp mặt. Khi tẩy trang vùng mắt và môi, cần chú ý lau cẩn thận.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\">Để đảm bảo việc tẩy trang hiệu quả, bạn nên lau đến khi miếng bông tẩy trang cuối cùng không còn xuất hiện dấu hiệu của bụi bẩn và mỹ phẩm trang điểm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">HSD:</strong> Xem trên sản phẩm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Thể tích thực:</strong> 100g</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Xuất xứ</strong>: Hàn Quốc</p>\r\n</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546615559, 1549105527, 49, '', '', '', 0, '121,134', '', 0, 0, '', '', '', '', '', '', '', 'Nước tẩy trang trà xanh Celluna - CELLUNA GREEN TEA WATER CLEANSER', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '100ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(524, 121, 134, 0, 0, 0, '811158467076.jpg', '', 'Tinh dầu tẩy trang Olive & Đậu ngọt', '', '', 'tinh-dau-tay-trang-olive-va-dau-ngot', '376000', 0, '<div><strong>Công dụng:</strong> Làm sạch làn da và lỗ chân long, ngăn ngừa các tác nhân gây mất độ ẩm cho da, làm da luôn mềm mại, không gây kích ứng cho da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Lắc đều sản phẩm để các dung dịch được trộn đều, sau đó lau sạch toàn bộ khuôn mặt rồi cho sản phẩm lên bông tẩy trang và thoa đều toàn bộ khuôn mặt.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> Chiết xuất từ tinh dầu chanh, ô liu, đậu ngọt, không chứa các thành phần hóa học gây kích ứng cho da.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Trọng lượng</strong> 100ml.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Công ty Doosun – Hàn Quốc</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546615740, 1549022539, 64, '', '', '', 0, '121,134', '', 0, 0, '', '', '', '', '', '', '', 'Tinh dầu tẩy trang Olive & Đậu ngọt Jajacnanum - BUSH CLOVER ATO OLIVE CLEAN WATER ', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '100ml', '', '', 'Công ty Doosun – Hàn Quốc'),
(525, 121, 135, 0, 0, 0, '288642619413.jpg', '', 'Sữa rửa mặt hoa đậu ngọt ATO (dạng bọt)', '', '', 'sua-rua-mat-hoa-dau-ngot-ato-dang-bot', '556000', 0, '<div><strong>Công dụng:</strong> Tái sinh, làm mềm, giữ ẩm, làm sạch sâu cho da, cải thiện làn da khô ráb, trị viêm da, mụn trứng cá. Thích hợp cho tất cả mọi loại da bao gồm làn da nhạy cảm nhất, da bị tổn thương và phụ nữ mang thai.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Cách dùng:</strong> Lấy một lượng vừa đủ rat ay, thoa đều lên mặt, massage và rửa sạch bằng nước ấm. Sử dụng 2 lần/ngày (sáng, tối).</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Thành phần:</strong> Chiết xuất từ tinh chất nhựa cây seberia.</div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>Trọng lượng</strong> 150g.</div>\r\n\r\n<div>\r\n<div> </div>\r\n\r\n<div><strong>Nhà sản xuất:</strong> Jajacnanum Co., LTD – Hàn Quốc</div>\r\n</div>\r\n', '', '', '', '', '', '', '', 1, 1, 1546615879, 1549022359, 13, '', '', '', 0, '121,135', '', 0, 0, '', '', '', '', '', '', '', 'Sữa rửa mặt hoa đậu ngọt ATO (dạng bọt) - BUSH CLOVER FORM CLEANSING ATO', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '150g', '', '', 'jajacnanum., Co LTD – Hàn Quốc'),
(526, 121, 135, 0, 0, 0, '930085294827.jpg', '', 'Sữa rửa mặt trà xanh làm sạch - sáng da', '', '', 'sua-rua-mat-tra-xanh-lam-sach-sang-da', '186000', 0, '<div>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Công dụng:</strong> Được chiết xuất từ các thảo dược và trà xanh có khả năng loại bỏ các tế bào chết trên da giúp làm sạch sâu, tái tạo mới làn da, làm sáng da, chống oxy hóa ngăn ngừa mụn, viêm hiệu quả.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\">Thích hợp cho mọi loại da, tốt hơn cho da dầu và da mụn.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Thành phần:</strong> Trà xanh, Thảo dược,…</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Cách dùng:</strong> Làm ướt da mặt, lấy một lượng vừa đủ ra lòng bàn tay, tạo bọt, massage nhẹ nhàng lên da, sau đó rửa sạch lại với nước ấm. Sử dụng 2 lần/ngày, sáng và tối để giữ da luôn sạch mịn.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Bảo quản:</strong> Để 