(527, 123, 113, 0, 0, 0, '381397426808.jpg', '', 'Phấn tươi đa chức năng Tinh Chất Vàng', '', '', 'phan-tuoi-da-chuc-nang-tinh-chat-vang', '536000', 0, '<p>Phấn tươi đa chức năng Tinh Chất Vàng - COVERQUEEN ORINTAL GOLD ESSENCE FOUNDATION<br />\r\nĐược chiết xuất từ tinh chất vàng và các loại thảo dược tự nhiên giúp kết cấu da mềm mại với lớp phủ đặc biệt, độ che phủ khuyết điểm cao: lỗ chân lông to, vết nám, tàn nhang,...tạo hiệu ứng đồng đều làm cho da trở nên tự nhiên và rạng rỡ. Ngoài ra, sản phẩm còn hỗ trợ tái tao, làm trắng sáng da và bảo vệ chống tia UV.<br />\r\nCách dùng: Sau khi sử dụng tinh chất chống nắng Lấy một lượng vừa phải vào miếng bông và tán đều khắp mặt. Khi sử dụng bông, dùng mép của bông để tán đều.<br />\r\nThành phần: Chiết xuất từ tinh chất vàng, hoa sen, nấm sanghwang, dầu hạt cây rum, và các chiết xuất từ thảo mộc phương Đông.</p>\r\n\r\n<p>Ngoài ra còn có Phấn tươi sơ cua đa chức năng tinh chất vàng<br />\r\n* Giá: 286.000đ/hộp (12g)</p>\r\n\r\n<p>Màu sắc: #1 - màu sáng, #2 - màu da tự nhiên<br />\r\nTrọng lượng: 12g<br />\r\nBảo quản: Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.<br />\r\nHSD: Xem trên bao bì.<br />\r\nSản Xuất : Hàn Quốc</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1546616168, 1549013551, 22, '', '', '', 0, '123,113', '', 0, 0, '', '', '', '', '', '', '', 'Phấn tươi đa chức năng Tinh Chất Vàng - COVERQUEEN ORINTAL GOLD ESSENCE FOUNDATION', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', ''),
