(529, 123, 116, 0, 1, 0, '098521052152.jpg', '', 'Phấn nước The Artist', '', '', 'phan-nuoc-the-artist', '250000', 0, '<p><strong>Công dụng: </strong><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Phấn nước The Artist ngoài chức năng chính là mỹ phẩm trang điểm hiện đại, làm nên da sáng tự nhiên, che đi những khuyết điểm trên gương mặt như mụn, vết thâm nám thì còn có chức năng dưỡng ẩm và cải thiện nếp nhăn rất tốt.<br />\r\n<strong>Thành phần:</strong> chiết xuất từ Vàng, Quả Lựu, Cám gạo, Sữa dê, Hoa Sen Tuyết...</span></p>\r\n', '', '', '', '', '', '', '', 1, 1, 1546616367, 1549018124, 39, '', '', '', 0, '123,116', '', 0, 0, '', '', '', '', '', '', '', 'Phấn nước The Artist - THE ARTIST FOUNDATION CURSHION', '', '', 'san-pham', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', ''),
