(532, 122, 143, 0, NULL, NULL, '642623040538.jpg', NULL, 'Bộ trang điểm Tinh Chất Vàng', '', '', 'bo-trang-diem-tinh-chat-vang', '1236000', 0, '<p>Bộ trang điểm Tinh Chất Vàng -  COVERQUEEN ORIENTAL GOLD SET<br />\r\nThành phần: Chiết xuất từ tinh chất vàng, hoa sen, nấm sanghwang, dầu hạt cây rum, và các chiết xuất từ thảo mộc phương Đông.<br />\r\nCông dụng: Được chiết xuất từ tinh chất vàng và các loại thảo dược tự nhiên, sản phẩm trang điểm và bảo vệ làn da khỏi tia UV, giảm nếp nhăn, dưỡng ẩm và giảm sự sản xuất sắc tố melanin làm trắng sáng da. Sản phẩm giúp làn da của bạn vừa được bảo vệ vừa được nuôi dưỡng và trở nên sáng mịn tự nhiên khi trang điểm<br />\r\n✴️Bộ sản phẩm bao gồm:</p>\r\n\r\n<p>* TINH CHẤT CHỐNG NẮNG, DƯỠNG DA CAO CẤP SPF 50+, PA +++ Coverqueen Oriental Gold Essential Sun Base<br />\r\nCông dụng: Được chiết xuất từ tinh chất vàng và các loại thảo dược tự nhiên, tinh chất chống nắng bảo vệ làn da khỏi tia UV, giảm nếp nhăn, dưỡng ẩm và giảm sự sản xuất sắc tố melanin làm trắng sang da. Sản phẩm giúp làn da của bạn vừa được bảo vệ vừa được nuôi dưỡng và trở nên sáng mịn. Cách dùng: Sau bước chăm sóc da, lấy một lượng vừa đủ, nhẹ nhàng tán đều theo kết cấu da. Trọng lượng: 30g</p>\r\n\r\n<p>* PHẤN TƯƠI TRANG ĐIỂM CAO CẤP ĐA CHỨC NĂNG SPF47 PA+++ Coverqueen Oriental Gold Essence Foundation<br />\r\nCông dụng: Được chiết xuất từ tinh chất vàng và các loại thảo dược tự nhiên giúp kết cấu da mềm mại với lớp phủ đặc biệt, độ che phủ khuyết điểm cao: lỗ chân lông to, vết nám, tàn nhang. tạo hiệu ứng đồng đều làm cho da trở nên tự nhiên và rạng rỡ. Ngoài ra, sản phẩm còn hỗ trợ tái tao, làm trắng sáng da và bảo vệ chống tia UV Cách dùng: Sau khi sử dụng tinh chất chống nắng, lấy một lượng vừa phải vào miếng bông và tán đều khắp mặt. Khi sử dụng bông, dùng mép của bông để tán đều. Màu sắc: #1 - màu sáng, #2 - màu da tự nhiên Trọng lượng: 12g</p>\r\n\r\n<p>* PHẤN PHỦ TRANG ĐIỂM CAO CẤP SPF50 PA+++ Coverqueen Oriental Gold Moisture Pact<br />\r\nCông dụng: Được chiết xuất từ tinh chất vàng và các loại thảo mộc phương Đông. Kết cấu mềm mại các hạt phấn cực mịn độ bám dính cao nhưng vẫn thông thoáng cho da. Phấn phủ siêu mịn bảo vệ da khỏi nếp nhăn, ngăn chặn ánh nắng mặt trời giúp làn da mịn màng, tự nhiên và rõ ràng. Kiểm soát bã nhờn giữ cho da mềm mại cả ngày ngay cả sau khi trang điểm. Cách dùng: Bước cuối cùng của trang điểm, dặm bằng bông phấn hoặc chổi tán đều trên toàn bộ da mặt. Màu sắc: #1 - Màu sáng, #2 - màu da tự nhiên Trọng lượng: 13g Bảo quản: Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p>HSD: Xem trên bao bì.</p>\r\n\r\n<p>Xuất Xứ : Hàn Quốc</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1549011025, 1549013692, NULL, '', '', NULL, NULL, '122,143', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'TINH CHẤT CHỐNG NẮNG, DƯỠNG DA CAO CẤP (Coverqueen Oriental Gold Essential Sun Base) + PHẤN TƯƠI TRANG ĐIỂM CAO CẤP ĐA CHỨC NĂNG (Coverqueen Oriental Gold Essence Foundation) + PHẤN PHỦ TRANG ĐIỂM CAO CẤP (Coverqueen Oriental Gold Moisture Pact)', '', '', 'san-pham', '', '', '', '', '', '', '', NULL, '', '', '', NULL, NULL, NULL, NULL),
(533, 112, 138, 0, 1, NULL, '724177385979.jpg', NULL, 'Mặt nạ tinh chất Serum dưỡng da - Collagen', '', '', 'mat-na-tinh-chat-serum-duong-da-collagen', '250000', 0, '<p><strong>Công dụng: </strong><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">mặt nạ Collagen giúp bạn có một làn da chắc khỏe, chống lại quá trình lão hóa, từ đó làm mờ các vết nhăn, mang đến cho bạn làn da săn chắc, mịn màng và trắng sáng.</span><br />\r\n<strong>Phương pháp sử dụng:</strong><br />\r\n1) Làm sạch da trước, nhớ rửa sạch bằng nước<br />\r\n2) Đặt mặt nạ lên mặt và nhẹ nhàng thoa đều lên da mặt (để cải thiện sự thẩm thấu của tinh chất vào da).<br />\r\n3) Tháo mặt nạ sau 10-15 phút sử dụng.<br />\r\n4) Không rửa mặt sau khi sử dụng, nhẹ nhàng đập tàn dư của mặt nạ vào da mặt, cổ hoặc da khác bằng đầu ngón tay.<br />\r\nĐể duy trì hiệu quả của làn da khỏe mạnh và giữ ẩm, nên sử dụng 2-3 lần một tuần.<br />\r\n<strong>Thành phần:</strong> nước tinh khiết, glycerin, 1,3 butylene glycol, ethanol, dầu hydro hóa, allantoin, midazolinid502 urea, methyl paraben, muối disodium, carbome, triethanolamine, collagen, nước hoa.</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1549017412, 1549017588, NULL, '', '', NULL, NULL, '112,138', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'Mặt nạ tinh chất Serum dưỡng da - Collagen (thương hiệu Billidian)', '', '', 'san-pham', '', '', '', '', '', '', '', NULL, '', '', '', NULL, NULL, NULL, NULL),
