(545, 129, 141, 0, NULL, NULL, '799281793770.jpg', NULL, 'Nước cân bằng dưỡng trắng sáng da (hoa hồng)', '', '', 'nuoc-can-bang-duong-trang-sang-da-hoa-hong', '956000', 0, '<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Thành phần:</strong> sản phẩm chứa tinh dầu Ylang, tinh chất hoa hồng giúp cải thiện các làn da bị nám, xỉn màu trở nên sáng hơn và làm mờ các vết nám, mụn thâm, loại bỏ các lớp sừng trên da. Giúp làm sạch sâu, điều chỉnh cân bằng PH cho da, se khít lỗ chân lông.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\">Thành phần axit hyaluronic trong sản phẩm có hiệu quả cung cấp độ ẩm tự nhiên, giúp giữ ẩm và làm da trở nên mềm mại , trắng sáng da.<br />\r\n<br />\r\n<span style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Loại da:</strong> Tất cả các loại da bao gồm làn da nhạy cảm nhất ngay cả phụ nữ mang thai và trẻ em.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Cách sử dụng</strong>: Sau khi rửa mặt xong, thoa nước hoa hồng lên mặt và dùng tay vỗ nhẹ để thẩm thấu sâu vào da.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Thể tích thực:</strong> 100g</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Hạn sử dụng:</strong> xem trên bao bì.</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1549023869, NULL, NULL, '', '', NULL, 1, '129,141', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'NƯỚC CÂN BẰNG DƯỠNG TRẮNG SÁNG DA - THE NANUM ROSE WHITE TONER', '', '', 'san-pham', '', '', '', '', '', '', '', NULL, '', '', '', NULL, NULL, NULL, NULL),
