ns-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 18px;\"><strong>Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 18px;\"><strong>Hạn sử dụng:</strong> xem trên bao bì.</span></p>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', '', '', 1, 1, 1549024045, 1557584461, NULL, '', '', NULL, 1, '129,131', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'NHŨ TƯƠNG DƯỠNG TRẮNG SÁNG DA - THE NANUM ROSE WHITE EMULSION', '', '', 'san-pham', '', '', '', '', '', '', '', NULL, '', '', '', NULL, NULL, NULL, NULL),
