(548, 129, 124, 0, 1, 1, '877372192270.jpg', NULL, 'Kem chống lão hóa - ngăn ngừa nám - phục hồi tái tạo da', '', '', 'kem-chong-lao-hoa-ngan-ngua-nam-phuc-hoi-tai-tao-da', '636000', 0, '<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><strong>Công dụng :</strong> Được chiết xuất từ collagen và hồng sâm có tác dụng tăng cường độ đàn hồi và khả năng miễn dịch cho da, tăng sinh collagen & Elastin trẻ hoá tế bào, săn chắc và se khít lỗ chân lông. Cung cấp độ ẩm và dưỡng chất vào sâu bên trong da phục hồi da hư tổn, giúp tái tạo sản sinh tế bào mới làm mờ các vết thâm, sạm, nám tàn nh</span><span class=\"text_exposed_show\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">ang ngăn ngừa chúng trở lại.<br />\r\n<strong>Thành phần:</strong> adennosine và niacinamide có tác dụng kép trong việc chống lão hoá và làm trắng sáng da</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><strong>Hướng dẫn sử dụng :</strong> Bước cuối cùng của chăm sóc da. Lấy một lượng kem vừa đủ, thoa đều nhẹ nhàng lên trên da. Vỗ nhẹ và massage để các dưỡng chất thẩm thấu hết vào da.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><strong>Sử dụng:</strong> 2 lần sáng và tối để làn da cải thiện làn da nhanh hơn.</span><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\" />\r\n<span style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: none; color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">Thể tích : 110g</span></p>\r\n', '', '', '', '', '', '', '', 1, 1, 1549104582, NULL, NULL, '', '', NULL, NULL, '129,124', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'Kem dưỡng chống lão hóa, ngăn ngừa nám, phục hồi tái tạo da - ULTIMATE REVITALIZER COLLAGEN RED GINSENG CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', NULL, '', '', '', NULL, NULL, NULL, NULL);
