(549, 129, 124, 0, 1, 1, '131371322775.jpg', NULL, 'Kem dưỡng trắng - làm mờ nám, sạm - ngăn ngừa lão hóa', '', '', 'kem-duong-trang-lam-mo-nam-sam-ngan-ngua-lao-hoa', '636000', 0, '<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Công dụng:</strong> Siêu kem Celluna có khả năng cung cấp dưỡng chất vượt trội vào sâu bên trong da. Giúp nhanh chóng làm trắng da, xoá mờ các vết sạm, nám, các sắc tố đen trên da và ngăn ngừa chúng trở lại.<br />\r\n<strong>Thành phần:</strong> a xít hyaduronic và beta glucan hình thành màng bảo vệ trên da giúp da không bị kích ứng hoặc nhạy cảm do môi trường bên ngoài. Ô liu giúp dưỡng ẩm sâu và khoá ẩm cho da, chống oxy hoá và lấy đi các tế bào chết trên da. Adenosine và niacinamide tái tạo tế bào da, tăng cường độ bóng, độ đàn hồi, cải thiện nếp nhăn làm cho da trắng hồng tự nhiên.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Hướng dẫn sử dụng :</strong> Bước cuối cùng của chăm sóc da. Lấy một lượng kem vừa đủ, thoa đều nhẹ nhàng lên trên da. Vỗ nhẹ và massage để các dưỡng chất thẩm thấu hết vào da.<br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px;\" />\r\n<strong>Sử dụng:</strong> 2 lần sáng và tối để làn da cải thiện làn da nhanh hơn.<br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px;\" />\r\n<strong>Thể tích :</strong> 110g</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1549104784, NULL, NULL, '', '', NULL, NULL, '129,124', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'Kem dưỡng trắng, làm mờ nám, sạm da, ngăn ngừa lão hóa - ULTIMATE REVITALIZER WHITENING ANTI-WRINKLE CREAM', '', '', 'san-pham', '', '', '', '', '', '', '', NULL, '', '', '', NULL, NULL, NULL, NULL),
(550, 122, 136, 0, NULL, 1, '777541047130.jpg', NULL, 'Bộ sữa tắm - dầu gội - dầu xả Thảo dược HYANGIDOO', '', '', 'bo-sua-tam-dau-goi-dau-xa-thao-duoc-hyangidoo', '506000', 0, '<p><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\">* FLOWER BODY WASH – 500g:<br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px;\" />\r\nSỮA TẮM THẢO DƯỢC (chiết xuất từ các loài hoa)</strong><br />\r\n </p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Công dụng:</strong> Sữa tắm chiết xuất từ hoa sen, hoa anh đào, hoa hồng & hoa súng giúp làm sạch và cung cấp độ ẩm cho da. Mang lại làn da sạch sẽ và tươi sáng.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Cách sử dụng:</strong> Lấy một lượng thích hợp vào miếng bọt biển hoặc bông tắm và tạo bọt, rồi mát xa toàn thân. Sau đó xả sạch với nước.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">* FLOWER HAIR CLEANSER – 500g:<br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px;\" />\r\n* DẦU GỘI ĐẦU THẢO DƯỢC (chiết xuất từ các loài hoa – chống gãy rụng tóc ) </strong><br />\r\n </p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Công dụng:</strong> Chiết xuất từ hoa sen, hoa anh đào, hoa hồng & hoa súng giúp làm sạch tóc và lấy đi bã nhờn trên da đầu. Tạo cảm giác thư giãn với mùi hương nhẹ nhàng, mang lại một mái tóc khỏe mạnh, mềm mượt và chống gãy rụng tóc.<br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px;\" />\r\n<strong>Cách sử dụng:</strong> Lấy một lượng vừa đủ dầu gội, tạo bọt rồi thoa đều lên tóc ướt, mát xoa nhẹ nhàng. Sau đó, gội lại sạch bằng nước ấm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">* FLOWER HAIR RINSE – 500g:<br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px;\" />\r\nDẦU XẢ THẢO RƯỢC (chiết xuất từ các loài hoa – chống gãy rụng tóc )</strong><br />\r\n<span style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Công dụng:</strong> Chiết xuất từ hoa sen, hoa anh đào, hoa hồng & hoa súng giúp cung cấp dưỡng chất và độ bóng cho tóc. Tạo cảm giác thư giãn với mùi hương nhẹ nhàng, mang lại một mái tóc bồng bềnh, khỏe mạnh và mềm mượt.</span><br style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\" />\r\n<br />\r\n<br />\r\n<span style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial; font-size: 13px; background-color: rgb(255, 255, 255);\"><strong>Cách sử dụng: </strong>Sau khi gội đầu, lấy một lượng vừa đủ thoa lên tóc ướt, mát xa tóc và da đầu sau 3 phút. Sau đó, xả sạch lại với nước ấm.</span></p>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', '', '', 1, 1, 1549105156, NULL, NULL, '', '', NULL, NULL, '122,136', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'Bộ sữa tắm, dầu gội, dầu xả Thảo dược - HYANGIDOO FLOWER WASH', '', '', 'san-pham', '', '', '', '', '', '', '', NULL, '', '', '', NULL, NULL, NULL, NULL),
(551, 112, 138, 0, 1, 1, '814377447859.jpg', NULL, 'Mặt nạ thần dược AMPOUL', '', '', 'mat-na-than-duoc-ampoul', '399000', 0, '', '', '', '', '', '', '', '', 1, 1, 1549105681, NULL, NULL, '', '', NULL, NULL, '112,138', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'Mặt nạ thần dược AMPOUL - AMPOUL Mask', '', '', 'san-pham', '', '', '', '', '', '', '', NULL, '', '', '', NULL, NULL, NULL, NULL),
(552, 129, 125, 0, NULL, 1, '649446052985.jpg', NULL, 'Sữa dưỡng thể làm trắng chăm sóc da chuyên sâu', '', '', 'sua-duong-the-lam-trang-cham-soc-da-chuyen-sau', '268000', 0, '<p><strong>Công dụng :</strong> Được chiết xuất hoàn toàn từ thiên nhiên quả cherry, bơ hạt mỡ, hoa cúc, lô hội, vitamin… cung cấp độ ẩm, dưỡng chất sâu cho da. Đào thải các oxy hóa gây hại cho da, chống lão hóa da, ngăn ngừa mất nước ở tầng biểu bì da. Đồng thời giải tỏa căng thẳng cho da, cải thiện và giảm các triệu trứng mụn, ngứa, bong tróc, khô rát da. Giúp da luôn trắng sáng mền mại và sạch sẽ.<br />\r\n<strong>Cách dùng:</strong> Sau khi tắm, thấm khô da, lấy một lượng thích hợp thoa lên toàn bộ cơ thể và massage nhẹ nhàng.<br />\r\n<strong>Thể tích thực:</strong> 270ml<br />\r\n<strong>Bảo quản:</strong> Để sản phẩm ở nơi khô ráo, thoáng mát tránh ánh nắng mặt trời.<br />\r\n<strong>Thành phần:</strong> Quả Cherry, Bơ hạt mỡ, Hoa cúc, lô hội, Quả lựu, các vitamin…<br />\r\n<strong>HSD:</strong> Xem trên sản phẩm. </p>\r\n\r\n<p><strong>Xuất xứ:</strong> Hàn Quốc</p>\r\n', '', '', '', '', '', '', '', 1, 1, 1549105897, 1557583546, NULL, '', '', NULL, NULL, '129,125', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'Sữa dưỡng thể làm trắng chăm sóc da chuyên sâu - CELLUNA PROFESSIONAL BODY CARE LOTION', '', '', 'san-pham', '', '', '', '', '', '', '', NULL, '', '', '', NULL, NULL, NULL, NULL);
