(3, 620, 0, 0, '', '', '', 'Giới Thiệu sản phẩm', '', 1, 1, 'product', 0, 0, 0, '', '<p style=\"text-align:justify\"><strong>Th&ocirc;ng tin sản phẩm</strong></p>\r\n\r\n<p style=\"text-align:justify\">Đồ chơi gỗ Edugames đ&ograve;i hỏi người chơi phải ph&aacute;t huy tối đa khả năng s&aacute;ng tạo của m&igrave;nh bởi t&iacute;nh phong ph&uacute;, mới lạ v&agrave; hấp dẫn trong c&aacute;ch chơi. Kh&ocirc;ng chỉ k&iacute;ch th&iacute;ch tr&iacute; n&atilde;o, đồ chơi c&ograve;n gi&uacute;p r&egrave;n luyện t&iacute;nh kh&eacute;o l&eacute;o, khả năng phối hợp giữa tay v&agrave; mắt, tăng khả năng tập trung v&agrave; thao t&aacute;c nhanh nhẹn.</p>\r\n\r\n<p style=\"text-align:justify\">Kh&ocirc;ng chỉ c&oacute; nhiều m&agrave;u sắc nổi bật gi&uacute;p b&eacute; thỏa th&iacute;ch s&aacute;ng tạo v&agrave; ph&aacute;t triển thị gi&aacute;c, đồ chơi tranh gh&eacute;p c&ograve;n được l&agrave;m từ chất liệu an to&agrave;n. Do đ&oacute;, b&eacute; c&oacute; thể thoải m&aacute;i tiếp x&uacute;c m&agrave; kh&ocirc;ng lo ảnh hưởng đến sức khỏe.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Chi tiết sản phẩm:</strong></p>\r\n\r\n<p style=\"text-align:justify\">Tranh Gh&eacute;p 16 x 24 cm Edugames GB122 kh&ocirc;ng chỉ đơn thuần l&agrave; đồ chơi m&agrave; c&ograve;n l&agrave; cả thế giới nghệ thuật d&agrave;nh cho c&aacute;c b&eacute;. Với nhiều tranh gh&eacute;p h&igrave;nh th&uacute; kh&aacute;c nhau b&eacute; sẽ thỏa th&iacute;ch lựa chọn cho m&igrave;nh loại động vật y&ecirc;u th&iacute;ch sau đ&oacute; nhớ lại c&aacute;c h&igrave;nh d&aacute;ng của con vật ấy, từ đ&oacute; b&eacute; sẽ tư duy d&ugrave;ng c&aacute;c mảnh gh&eacute;p sao cho tr&ugrave;ng khớp v&agrave; gh&eacute;p th&agrave;nh h&igrave;nh con vật ho&agrave;n chỉnh.</p>\r\n\r\n<p style=\"text-align:justify\">Đồ chơi đ&ograve;i hỏi người chơi phải ph&aacute;t huy tối đa khả năng s&aacute;ng tạo của m&igrave;nh bởi t&iacute;nh phong ph&uacute;, mới lạ v&agrave; hấp dẫn trong c&aacute;ch chơi. Kh&ocirc;ng chỉ k&iacute;ch th&iacute;ch tr&iacute; n&atilde;o, đồ chơi l&agrave;m từ gỗ c&ograve;n gi&uacute;p r&egrave;n luyện t&iacute;nh kh&eacute;o l&eacute;o, khả năng phối hợp giữa tay v&agrave; mắt, tăng khả năng tập trung v&agrave; thao t&aacute;c nhanh nhẹn.</p>\r\n\r\n<p style=\"text-align:justify\">Một trong những ti&ecirc;u ch&iacute; ch&iacute;nh của đồ chơi gỗ mang lại ch&iacute;nh l&agrave; khả năng gắn kết mọi th&agrave;nh vi&ecirc;n trong gia đ&igrave;nh. Bố mẹ c&oacute; thể chơi c&ugrave;ng b&eacute;, trao đổi để gi&uacute;p trẻ s&aacute;ng tạo hơn v&agrave; đặc biệt l&agrave; gi&uacute;p c&aacute;c th&agrave;nh vi&ecirc;n trong nh&agrave; gần gũi nhau hơn.</p>\r\n\r\n<p style=\"text-align:justify\">K&iacute;ch thước : 16 x 24 cm.</p>\r\n\r\n<p style=\"text-align:justify\">Sản xuất tại Việt Nam</p>\r\n', '', ''),
(4, 415, 0, 0, '', '', '', 'Vị trí', '', 1, 1, '', 0, 0, 0, '', '<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><span style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">CÁC TIỆN ÍCH&nbsp;PREMIER VILLAGE PHÚ QUỐC RESORT&nbsp;</strong></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><span style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">&nbsp;</strong></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><span style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">&nbsp;</strong></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">Với kỳ vọng trở thành khu&nbsp;<strong style=\"margin: 0px; padding: 0px;\">biệt thự biển</strong>&nbsp;nghỉ dưỡng có kiến trúc độc đáo nhất, quyến rũ nhất Việt Nam, vượt qua cả khu nghỉ dưỡng sang trọng bậc nhất thế giới InterConteninental Sun Peninsula Đà Nẵng, những tiện ích đẳng cấp mà&nbsp;Premier Village Phú Quốc resort&nbsp;mang lại cũng là một điều rất nhiều nhà đầu tư và du khách đang mong đợi.</p>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">Có ưu thế tuyệt đối khi tọa lạc tại eo biển đẹp nhất&nbsp;<strong style=\"margin: 0px; padding: 0px;\">Phú Quốc</strong>&nbsp;– Mũi Ông Đội,&nbsp;<strong style=\"margin: 0px; padding: 0px;\">Premier Village Phú Quốc Resort</strong>&nbsp;có những tiện ích vô cùng độc đáo:</p>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<ul style=\"margin: 0px; padding-right: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\"><strong style=\"margin: 0px; padding: 0px;\">Bể bơi vô cực</strong>: Bể bơi vô cực được coi là một đột phá trong thiết kế kiến trúc bể bơi. Khác với bể bơi tràn bờ tại Premier Village Đà Nẵng, được lấy cảm hứng từ ruộng bậc thang ở Sapa, bể bơi chân mây tại Premier Village Phú Quốc được thiết kế tràn từ bờ biển Đông Nam sang bờ biển phía Tây Bắc. Bể bơi vô cực là một điểm nhấn độc đáo trong quần thể kiến trúc Premier Village Phú Quốc, khẳng định vị thế của một khu nghỉ dưỡng sang trọng và tinh tế bậc nhất thế giới. Được thiết kế theo các bậc, du khách vừa ngâm mình trong làn nước vừa ngắm nhìn thiên nhiên hung vĩ của rừng nguyên sinh, của biển xanh cát trắng mịn màng như kem. Chắc chắn bể bơi vô cực sẽ mang tới cho du khách những trải nghiệm tuyệt vời chưa nơi nào có.</li>\r\n</ul>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<ul style=\"margin: 0px; padding-right: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\"><strong style=\"margin: 0px; padding: 0px;\">Hệ thống Spa trong rừng:</strong>Trân trọng những khoảnh khắc du khách tới nghỉ ngơi, tại Premier Village quý khách vừa được chăm sóc bản thân một cách trọn vẹn sau những phút giây bận rộn, vừa được thưởng thức khí trời tươi mát&nbsp;và màu xanh bát ngát của các tán rừng nguyên sinh. Nép mình trong tán rừng nguyên sinh, vẻ đẹp của hệ thống spa cũng như dịch vụ khách hàng hoàn hảo sẽ mang đến cho quý khách sự hài lòng tuyệt đối.</li>\r\n</ul>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<ul style=\"margin: 0px; padding-right: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\"><strong style=\"margin: 0px; padding: 0px;\">Nhà hàng trên vách núi nhô ra biển:</strong><span style=\"margin: 0px; padding: 0px;\">Tận dụng triệt để lợi thế của cánh rừng nguyên sinh sát biển,&nbsp;Premier Village Phú Quốc Resort còn hấp dẫn du khách ở hệ thống nhà hàng độc đáo có 1 không 2. Trong không gian ẩm thực đặc sắc, du khách không chỉ được thưởng thức tinh hoa ẩm thực &nbsp;trên khắp các vùng miền của Việt Nam mà còn cả hương vị ẩm thực của toàn thế giới.&nbsp;Du khách vừa được thưởng thức những món ăn tinh tế từ đôi bàn tay khéo léo của các nghệ nhân tài ba, vừa được ngắm biển xanh cát trắng và trải nghiệm cảm giác chênh vênh của nhà hàng được xây dựng trên vách núi nhô ra biển.</span></li>\r\n</ul>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<ul style=\"margin: 0px; padding-right: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\"><strong style=\"margin: 0px; padding: 0px; line-height: 1.5;\">Bến cảng du thuyền:</strong><span style=\"margin: 0px; padding: 0px; line-height: 1.5;\">Sẽ thật đáng tiếc nếu du khách tới Premier Village Phú Quốc nghỉ dưỡng mà không được trải nghiệm vẻ đẹp tuyệt vời của eo biển đẹp nhất Phú Quốc – Mũi Ông Đội. Bến cảng du thuyền với những du thuyền siêu sang sẽ giúp cho du khách tận hưởng 100% vẻ đẹp của đại dương và biến kỳ nghỉ ở Premier Village Phú Quốc trở thành kỳ nghỉ dưỡng không thể nào quên.</span></li>\r\n</ul>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<ul style=\"margin: 0px; padding-right: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\">Các dịch vụ khác :</li>\r\n</ul>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">– &nbsp;Phòng họp hội nghị, tổ chức sự kiện với những không gian khác nhau tuỳ thuộc vào nhu cầu của từng khách hàng.</p>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">– &nbsp;Dịch vụ chăm sóc khách hàng hoàn hảo sẽ đáp ứng đầy đủ và tốt nhất tất cả những mong muốn của thượng khách khi nghỉ dưỡng tại đây cho dù đó là những yêu cầu khó khăn nhất.</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><span style=\"margin: 0px; padding: 0px; line-height: 1.5;\">&nbsp;</span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><span style=\"margin: 0px; padding: 0px;\">Biệt thự Premier Village Phú Quốc Resort dưới sự quản lý đầy của tập đoàn quản lý đầy kinh nghiệm sẽ mang lại cho du khách những trải nghiệm độc đáo, những kì nghỉ thượng lưu hiếm có tại Đảo Ngọc.&nbsp;</span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;</span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><img alt=\"InfinityPool3_1 copy\" class=\"alignnone wp-image-3057 size-large\" height=\"576\" src=\"http://premiervillagephuquocresort.com/wp-content/uploads/2015/12/InfinityPool3_1-copy-1024x576.jpg\" style=\"margin: 0px auto; padding: 0px; border: 0px; max-width: 90%; height: auto !important; display: block;\" width=\"1024\" /></p>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: center;\"><span style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">Khu bể bơi tràn bờ nối hai bờ từ bờ Đông sang bờ Tây</em></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><span style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;</em></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><img alt=\"nha hang11_1 copy\" class=\"alignnone wp-image-3059 size-large\" height=\"576\" src=\"http://premiervillagephuquocresort.com/wp-content/uploads/2015/12/nha-hang11_1-copy-1024x576.jpg\" style=\"margin: 0px auto; padding: 0px; border: 0px; max-width: 90%; height: auto !important; display: block;\" width=\"1024\" /></p>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: center;\"><em style=\"margin: 0px; padding: 0px;\">Nhà hàng&nbsp;trên mặt nước</em></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;</em></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><img alt=\"PoolfromBeachclubR2_1 copy\" class=\"alignnone wp-image-3060 size-large\" height=\"455\" src=\"http://premiervillagephuquocresort.com/wp-content/uploads/2015/12/PoolfromBeachclubR2_1-copy-1024x455.jpg\" style=\"margin: 0px auto; padding: 0px; border: 0px; max-width: 90%; height: auto !important; display: block;\" width=\"1024\" /></p>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: center;\"><span style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">Khu nhà hàng trên ghềnh đá&nbsp;</em></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><span style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;</em></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><img alt=\"kid club-sua lai nguoi_1 copy\" class=\"alignnone wp-image-3058 size-large\" height=\"576\" src=\"http://premiervillagephuquocresort.com/wp-content/uploads/2015/12/kid-club-sua-lai-nguoi_1-copy-1024x576.jpg\" style=\"margin: 0px auto; padding: 0px; border: 0px; max-width: 90%; height: auto !important; display: block;\" width=\"1024\" /></p>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: center;\"><span style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">Khu&nbsp;Kid Club</em></span></p>\r\n', '', ''),
(5, 415, 0, 0, '', '', '', 'MẶT BẰNG', '', 1, 1, '', 0, 0, 0, '', '<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: justify;\"><em style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Mặt bằng tổng thể Biệt thự biển Phú Quốc Premier Village Resort</strong></em></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: justify;\"><em style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">&nbsp;</strong></em></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px;\">Đảo Ngọc Phú Quốc</strong>&nbsp;– Thiên đường trên vùng biển Tây Nam :&nbsp;Nằm ở vị trí trung tâm khu vực Đông Nam Á, đảo Phú Quốc của tỉnh Kiên Giang có lợi thế quan trọng trong mối liên kết giao thông hàng hải, hàng không với các quốc gia trong khu vực và trên thế giới</p>\r\n\r\n<p class=\"no-margin\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px;\">Đảo ngọc Phú Quốc</strong>&nbsp;được biết đến với vẻ đẹp nên thơ mà thiên nhiên đã ban tặng nơi đây, ở Phú Quốc có rất nhiều danh lam thắng cảnh đẹp nhưng một trong số đó là&nbsp;<strong style=\"margin: 0px; padding: 0px;\">Mũi Ông Đội&nbsp;</strong></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px;\">&nbsp;</strong></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">&nbsp;<img alt=\"\" style=\"margin: 0px; padding: 0px; border: 0px; max-width: 90%; height: auto !important;\" /><img alt=\"\" src=\"http://i.imgur.com/EE3cJGX.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; max-width: 90%; height: auto !important;\" /></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><img alt=\"\" style=\"margin: 0px; padding: 0px; border: 0px; max-width: 90%; height: auto !important;\" /></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal; text-align: center;\"><em style=\"margin: 0px; padding: 0px;\">Mặt bằng tổng thế</em></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;</em></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px;\">THÔNG TIN DỰ ÁN&nbsp;PREMIER VILLAGE PHÚ QUỐC RESORT</strong></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px;\">&nbsp;</strong></p>\r\n\r\n<ul style=\"margin: 0px; padding-right: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\">Nằm tại mũi ông Đội – cực nam của đảo Phú Quốc<br style=\"margin: 0px; padding: 0px;\" />\r\n	&nbsp;</li>\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\">Tổng diện tích dự án: 73 ha<br style=\"margin: 0px; padding: 0px;\" />\r\n	&nbsp;</li>\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\">Tổng số lượng biệt thự: 120 căn<br style=\"margin: 0px; padding: 0px;\" />\r\n	&nbsp;</li>\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\">Mật độ xây dựng: 19.52%<br style=\"margin: 0px; padding: 0px;\" />\r\n	&nbsp;</li>\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\">Diện tích đất tối thiểu: 500m2<br style=\"margin: 0px; padding: 0px;\" />\r\n	&nbsp;</li>\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\">Số phòng ngủ: 3 – 4 – 5 phòng ngủ.<br style=\"margin: 0px; padding: 0px;\" />\r\n	&nbsp;</li>\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\">Tầng cao biệt thự: 1,5 – 2 tầng<br style=\"margin: 0px; padding: 0px;\" />\r\n	&nbsp;</li>\r\n	<li style=\"margin: 0px; padding: 0px; list-style: none;\">Tổng số loại BT: 7 loại chính<br style=\"margin: 0px; padding: 0px;\" />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px;\">CÁC LOẠI BIỆT THỰ&nbsp;PREMIER VILLAGE PHÚ QUỐC RESORT</strong></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px;\">&nbsp;</strong></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial; line-height: normal;\">1. Sun Ocean Villa (E – OW)<br style=\"margin: 0px; padding: 0px;\" />\r\n<br style=\"margin: 0px; padding: 0px;\" />\r\n2. Sun Bay Villa (B – DN)<br style=\"margin: 0px; padding: 0px;\" />\r\n<br style=\"margin: 0px; padding: 0px;\" />\r\n3. Sun Bay Villa (B- UP)<br style=\"margin: 0px; padding: 0px;\" />\r\n<br style=\"margin: 0px; padding: 0px;\" />\r\n4. &nbsp;Sun Deck Villa (C– DN )<br style=\"margin: 0px; padding: 0px;\" />\r\n<br style=\"margin: 0px; padding: 0px;\" />\r\n5. Sky View Villa (A – UP)<br style=\"margin: 0px; padding: 0px;\" />\r\n<br style=\"margin: 0px; padding: 0px;\" />\r\n6. Sun Set Villa (A – DN )<br style=\"margin: 0px; padding: 0px;\" />\r\n<br style=\"margin: 0px; padding: 0px;\" />\r\n7. Sun Rock Villa (F – OR)</p>\r\n', '', '');
