(1, 'NapieSkin', '', 'NapieSkin', '', '', '', 'Giới thiệu chung', 'napie-skin', '', '<div class=\"r-body\">\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">GIỚI THIỆU CHUNG</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">Được thành lập với sứ mệnh tôn vinh vẻ đẹp phụ nữ Việt Nam, NAPIE SKIN là dòng mỹ phẩm chất lượng cao, sản xuất theo công nghệ Hàn Quốc, với nguồn nguyên liệu chiết xuất thiên nhiên từ châu Âu. Doanh nhân Hồ Thị Thùy Linh, người sáng lập của thương hiệu NAPIE SKIN, tổng giám đốc công ty TNHH Mỹ Phẩm Napie tin rằng phụ nữ Việt xứng đáng được sử dụng những sản phẩm cao cấp nhất với chi phí thật hợp lý, chị em không còn phải lo lắng vì kem giả, kem trộn, mỹ phẩm kém chất lượng.</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">VỀ NGƯỜI SÁNG LẬP</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">Xuất phát điểm là một diễn viên, Doanh nhân Hồ Thị Thùy Linh cũng yêu thích làm đẹp và quan tâm đến vẻ ngoài của mình như bao người phụ nữ khác. Cô đã từng tìm kiếm và thử dùng rất nhiều loại mỹ phẩm khác nhau. Và cô cũng từng dính phải những lần dị ứng da, mặt sưng và sần đến độ không thể quay phim được, nằm nhà tránh nắng suốt một tháng. Từ đó Thùy Linh rất hiểu hành trình làm đẹp của chị em trắc trở thế nào, và khó khăn ra sao để tìm kiếm cho mình những sản phẩm làm đẹp thật sự tốt, an toàn, nguồn gốc rõ ràng.</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">Cô cứ mãi trăn trở: \"Mình phải làm gì đó cho những người yêu thích cái đẹp, những người phụ nữ đã quá bận rộn với cuộc sống, hy sinh vì gia đình. Họ đã có nhiều thứ để lo lắng lắm rồi, nhất định phải để họ thật sự an tâm, thoải mái và hạnh phúc với việc làm đẹp\".</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">Đó là lý do mà doanh nhân Thùy Linh quyết định bắt đầu thành lập công ty TNHH Mỹ Phẩm Napie với hoài bão “ĐÁNH THỨC VẺ ĐẸP LÀN DA”.</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">Không vội vàng chạy theo trào lưu, không hấp tấp cho kịp xu hướng, Thùy Linh đã mất gần 02 năm để học tập, nghiên cứu, thử nghiệm, v.v… chỉ để cải tiến và hoàn thiện các sản phẩm ở phiên bản tốt nhất.</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">SỨ MỆNH</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">Là dòng sản phẩm cao cấp, mang nhiệm vụ chăm sóc và cải thiện làn da cho khách hàng, nhưng sứ mệnh quan trọng hơn mà doanh nhân Hồ Thị Thùy Linh muốn gửi gắm vào thương hiệu NAPIE SKIN chính là MANG LẠI CUỘC SỐNG HẠNH PHÚC cho phụ nữ Việt.</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">Khi đã là một thành viên của NAPIE SKIN, thì công ty nói chung, cũng như từng sản phẩm của NAPIE SKIN nói riêng chính là cầu nối của chị em đến với con đường độc lập về tài chính, rạng rỡ về nhan sắc, thành công trong kinh doanh, và tất nhiên sẽ là hạnh phúc trong cuộc sống.</div>\r\n\r\n<div class=\"_2cuy _3dgx _2vxa\" style=\"direction: ltr; white-space: pre-wrap; box-sizing: border-box; margin: 0px auto 28px; width: 700px; overflow-wrap: break-word; font-family: Georgia, serif; color: rgb(28, 30, 33); font-size: 17px; background-color: rgb(255, 255, 255);\">Doanh nhân Thùy Linh cho biết, mục tiêu trong 05 năm tới của công ty TNHH Mỹ phẩm NAPIE cụ thể là sẽ mang đến vẻ đẹp và hạnh phúc cho tất cả phụ nữ trên khắp Việt Nam cũng như phát triển thương hiệu NAPIE SKIN tại các nước bạn.</div>\r\n</div>\r\n', '', '72850.png', '72850_290x230.png', 0, 1, 1225497589, 1339728897, '', '', '', '', '', '', '', '', '', 'Napie Skin', '', '', 'gioi-thieu', ''),
