(3, '', '', '', '', '', '', '', '', '<p>Hiện tại Thy Thy Shop đang có chương trình khuyến mãi đặc biệt \"GIẢM GIÁ 5% TẤT CẢ SẢN PHẨM\" khi đặt hàng online. Quy trình đặt hàng vô cùng đơn giản, hãy nhanh tay đặt hàng để được giảm ngay 5% nhé!<br />\r\nBước 1: Chọn sản phẩm cần mua<br />\r\nBước 2: Trong trang chi tiết sản phẩm hiện ra click vào nút  \" ĐẶT MUA\"<br />\r\nBước 3: Sau bước trên website sẽ chuyển sang trang giỏ hàng. Ở bước này bạn nhập các thông tin cần thiết theo yêu cầu<br />\r\nBước 4: Cập nhật đơn hàng thành công. Tiếp tục MUA SẮM hoặc THANH TOÁN<br />\r\nBước 5:  Sau khi hoàn thành bước 4 website sẽ thông báo cho bạn biết bạn đã đặt hàng thành công và nhân viên của shop sẽ liên hệ lại với bạn trong vòng 15p kể từ khi nhận được đơn đặt hàng.</p>\r\n', '<p>Hiện tại Thy Thy Shop đang có chương trình khuyến mãi đặc biệt \"GIẢM GIÁ 5% TẤT CẢ SẢN PHẨM\" khi đặt hàng online. Quy trình đặt hàng vô cùng đơn giản, hãy nhanh tay đặt hàng để được giảm ngay 5% nhé!<br />\r\nBước 1: Chọn sản phẩm cần mua<br />\r\nBước 2: Trong trang chi tiết sản phẩm hiện ra click vào nút &nbsp;\" ĐẶT MUA\"<br />\r\nBước 3: Sau bước trên website sẽ chuyển sang trang giỏ hàng. Ở bước này bạn nhập các thông tin cần thiết theo yêu cầu<br />\r\nBước 4: Cập nhật đơn hàng thành công. Tiếp tục MUA SẮM hoặc THANH TOÁN<br />\r\nBước 5: &nbsp;Sau khi hoàn thành bước 4 website sẽ thông báo cho bạn biết bạn đã đặt hàng thành công và nhân viên của shop sẽ liên hệ lại với bạn trong vòng 15p kể từ khi nhận được đơn đặt hàng.</p>\r\n', '', '64654.jpg', '64654_290x230.jpg', 1, 1, 0, 0, '', '', '', '', '', '', 'Hướng dẫn thanh toán', 'Hướng dẫn thanh toán', 'Hướng dẫn thanh toán', 'Hướng dẫn mua hàng', '', '', 'huong-dan', ''),
(4, '', '', '', '', '', '', '', '', '', '<p><strong><span style=\"font-size:12pt\">+&nbsp; Hình thức thanh toán:</span></strong><br />\r\n<span style=\"font-size:12pt\">&nbsp;&nbsp;</span><br />\r\n<span style=\"font-size:12pt\">- Thanh toán tiền mặt khi nhận hàng: chỉ áp dụng cho khu vực TP. HCM. (Trừ Ngoại thành HCM: Huyện Cần Giờ, Hóc Môn, Bình Chánh, Nhà Bè, Củ Chi, Quận 9, 12, Thủ Đức, Bình Tân)</span><br />\r\n<br />\r\n<span style=\"font-size:12pt\">- Chuyển khoản ngân hàng:&nbsp;áp dụng&nbsp;Ngoại thành HCM và các tỉnh thành khác&nbsp;</span><br />\r\n<br />\r\n<span style=\"font-size:12pt\">Chủ&nbsp;tài khoản:&nbsp;Công ty TNHH Thương Mại Vistar</span><br />\r\n<br />\r\n<span style=\"font-size:12pt\">Ngân hàng Eximbank – Chi Nhánh Cộng Hòa - TP HCM</span></p>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-size: 14px; line-height: 21px;\"><span style=\"font-size:12pt\">Số TK: 1404 1485 1028 671</span><br />\r\n<br />\r\n<strong><span style=\"font-size:12pt\">+&nbsp; Cước phí vận chuyển:</span></strong><br />\r\n<span style=\"font-size:12pt\">&nbsp;&nbsp;&nbsp;</span></div>\r\n\r\n<p><span style=\"font-size:12pt\">- Khu vực TP.Hồ Chí Minh:&nbsp;Đối với đơn hàng 500.000 đồng trở lên, Vistar Pharmacy sẽ giao hàng&nbsp;miễn&nbsp;phí tới nơi chỉ định của quý khách&nbsp;trong các quận nội thành TP.HCM, trừ các quận huyện sau: Huyện Cần Giờ, Hóc Môn, Bình Chánh, Nhà Bè, Củ Chi, Quận 9, 12, Thủ Đức, Bình Tân</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-size:12pt\">- Tỉnh thành khác:&nbsp;Cước phí vận chuyển được tính riêng theo từng đơn hàng cụ thể và sẽ được cộng chung vào giá trị hàng hóa và thông báo đến quý khách để xác nhận. Quý khách có thể xem biểu giá cước tham khảo của Công ty Chuyển phát nhanh.</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">&nbsp;&nbsp;&nbsp;</span>﻿<br />\r\n<strong><span style=\"font-size:12pt\">+&nbsp; Thời gian giao hàng:&nbsp;</span></strong></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Khu vực TP.Hồ Chí Minh: sau khi quý khách đặt hàng và nhận được email hoặc điện thoại xác nhận đặt hàng thành công, trong vòng 2-4 ngày, quý khách sẽ nhận được hàng hoá, cụ thể:</span></p>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-size: 14px; line-height: 21px;\"><span style=\"font-size:12pt\">Trong vòng 48h sau khi đặt hàng: Vistar Pharmacy xác nhận số lượng tồn hàng hoá</span></div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-size: 14px; line-height: 21px;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-size: 14px; line-height: 21px;\"><span style=\"font-size:12pt\">Sau khi xác nhận thực hiện đơn hàng, trong vòng 2-3 ngày Vistar Pharmacy sẽ tiến hành giao hàng&nbsp;</span></div>\r\n\r\n<p><span style=\"font-size:12pt\">&nbsp;</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Tỉnh thành khác:&nbsp;Sau khi nhận được thanh toán chuyển khoản qua ngân hàng, Vistar sẽ tiến hành đóng gói, dự kiến trong vòng 2-3 ngày sẽ bắt đầu giao hàng. Thời gian quý khách nhận hàng tùy thuộc vào tỉnh thành, quý khách có thể tham khảo thêm Dự kiến thời gian phát hàng của Công Ty Chuyển Phát Nhanh.</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-size:12pt\">Lưu ý: đối với khách hàng ở tỉnh,sau khi Vistar Pharmacy xác nhận số lượng tồn và phí vận chuyển thì trong vòng 7 ngày, quý khách phải chuyển tiền vào tài khoản công ty TNHH Thương Mại Vistar.Nếu quá thời gian trên, Vistar Pharmacy sẽ trả hàng lại kho.</span></p>\r\n', '', '88978.png', '88978_290x230.png', 1, 1, 0, 0, '', '', '', '', '', '', 'Dịch vụ thanh toán', 'Dịch vụ thanh toán', 'Dịch vụ thanh toán', 'Dịch vụ thanh toán', '', '', 'thanh-toan', ''),
