(7, '', '', '', '', '', '', '', '', '', '<p><span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">Nếu bạn có thắc mắc hay vấn đế cần giải quyết hãy nhớ rằng Bộ phận hỗ trợ khách hàng luôn sẵn sàng giúp đỡ mỗi khi bạn cần. Vì vậy, đừng do dự mà hãy liên hệ với chúng tôi thông qua hai cách sau đây:</span><br />\r\n<br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">1. Gọi điện thoại trực tiếp</span><br />\r\n<br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">Bộ phận hỗ trợ khách hàng của chúng tôi luôn sẵn sàng lắng nghe và giải đáp các vấn đề mà khách hàng gặp phải. Vì vậy, mỗi khi có thắc mắc, bạn đừng chần chừ mà hãy gọi ngay đến số (08) 7300 2015 để được giải đáp tận tình.</span><br />\r\n<br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">Thời gian phục vụ:</span><br />\r\n<br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">Thứ 2 đến Thứ 6: 7:00 – 18:00</span><br />\r\n<br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">Thứ 7, CN &amp; Lễ: 7:00 – 17:00</span><br />\r\n<br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">2. Gửi email tới hòm thư Vistar</span><br />\r\n<br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">Chúng tôi mong muốn giải đáp toàn bộ thắc mắc của khách hàng từ nhỏ cho đến lớn. Những email mà khách hàng gửi đến hòm thư Vistar sẽ được xử lý theo thứ tự thời gian tiếp nhận và phản hồi nhanh nhất có thể. Cho nên, hãy gửi ngay thắc mắc của bạn tới Bộ phận hỗ trợ khách hàng thông qua địa chỉ email&nbsp;</span><a href=\"mailto:info@vistarpharmacy.com\" style=\"box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(59, 175, 218); text-decoration: none; outline: none; font-size: 14px; line-height: 21px;\">info@vistarpharmacy.com</a><span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">&nbsp;để nhận được câu trả lời chính xác nhất.</span><br />\r\n<br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">3. Hệ thống cửa hàng</span><br />\r\n<br />\r\n<strong>CỘNG HÒA &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;NƠ TRANG LONG</strong><br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">532 - 534 Cộng Hòa, Phường 13, Quận Tân Bình &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 12 Nơ Trang Long, Phường 14, Quận Bình Thạnh</span><br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">Tel: 08.7300.2301 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Tel:08.7300.2303&nbsp;</span><br />\r\n<br />\r\n<strong>TRẦN HỮU TRANG &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ĐẶNG TẤT</strong><br />\r\n<span style=\"color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px\">84A/2 Trần Hữu Trang, Phường 10, Quận Phú Nhuận &nbsp; &nbsp; &nbsp; &nbsp;