(12, '', '', '', '', '', '', '', '', '', '<p style=\"line-height: 20.8px;\">Lời đầu tiên Công ty TNHH ĐT PT TM ALPHA kính chúc quý khách hàng được dồi dào sức khỏe, an khang, thịnh vượng.</p>\r\n\r\n<p style=\"line-height: 20.8px;\">Với hơn 10 năm&nbsp;hoạt động trong lĩnh vực may mặc các vật phẩm quảng cáo, ALPHA rất tự hào được sự tín nhiệm và ủng hộ của quý khách hàng trong và ngoài nước.</p>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong>1. Quy mô:</strong></p>\r\n\r\n<ul style=\"line-height: 20.8px; list-style-type: square;\">\r\n	<li>1 Xưởng áo mưa với 30 công nhân</li>\r\n	<li>1 xưởng may với 50 công nhân</li>\r\n	<li>1 xưởng in với 20 công nhân</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong>2. Năng lực:</strong></p>\r\n\r\n<p style=\"line-height: 20.8px;\">Sản lượng mỗi tháng đảm bảo ở mức:</p>\r\n\r\n<ul style=\"line-height: 20.8px; list-style-type: square;\">\r\n	<li>Áo mưa :100.000 cái/tháng</li>\r\n	<li>Nón kết, nón tai bèo: 50.000 cái/tháng</li>\r\n	<li>Ba lô, túi xách sản lượng tùy theo mẫu mã, những mẫu đơn giản có thể ra 100.000 hàng / 1tháng</li>\r\n	<li>Áo thun: 50.000 hàng / 1 tháng</li>\r\n	<li>Sản phẩm in ấn : 10.000.000 hàng / tháng</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 20.8px;\">&nbsp;</p>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong>3. Thị trường:</strong></p>\r\n\r\n<p style=\"line-height: 20.8px;\">Trong nước và xuất khẩu sang các nước: Mỹ,Nhật, Úc, Malaysia, Campuchia,…</p>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong>4. Sản phẩm của Alpha:</strong></p>\r\n\r\n<p style=\"line-height: 20.8px;\">Tất cả các sản phẩm quảng cáo , khuyến mãi và may mặc , in ấn như :</p>\r\n\r\n<ul style=\"line-height: 20.8px; list-style-type: square;\">\r\n	<li>Đồng phục công sở , bảo hộ lao động</li>\r\n	<li>Áo thun , balo, túi xách , túi vải không dệt , nón kết ,nón tai bèo</li>\r\n	<li>Sản phẩm khuyến mãi như áo mưa, áo trùm xe , ô dù , móc khóa , đồng hồ , ly tách …</li>\r\n	<li>Đặc biệt In ấn trên mọi chất liệu</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong>5. Tại sao bạn nên chọn Alpha?</strong></p>\r\n\r\n<p style=\"line-height: 20.8px;\">Vì đến với Alpha, Quý khách hàng sẽ được:</p>\r\n\r\n<ul style=\"line-height: 20.8px; list-style-type: square;\">\r\n	<li>Tư vấn, thiết kế, lên mẫu miễn phí</li>\r\n	<li>Có thể đáp ứng các đơn hàng gấp trong thời gian từ 3 – 5 ngày</li>\r\n	<li>&nbsp;Có thể hỗ trợ thực hiện các đơn hàng với số lượng ít</li>\r\n	<li>Được ưu đãi giá nếu bạn là Khách hàng thân thiết</li>\r\n	<li>Hưởng được sản phẩm, dịch vụ tốt nhất với giá cả cạnh tranh nhất</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 20.8px;\">Hãy liên hệ ngay với chúng tôi để nhận được báo giá và tư vấn nhanh nhất.</p>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong>Công ty chúng tôi luôn luôn làm bạn hài lòng !</strong></p>\r\n', '', '', '', 1, 1, 0, 0, '', '', '', '', '', '', '', '', '', 'Tuyển dụng', '', '', 'tuyen-dung', ''),
(13, 'Ý tưởng thiết kế', '', 'Ý tưởng thiết kế', '', '', '', '', 'y-tuong-thiet-ke', '', '<p style=\"text-align: justify;\">Không đơn giản chỉ là vật dụng đựng quà tặng, một chiếc hộp quà xinh xắn sẽ mang đến cho người nhận cảm giác thích thú và hơn thế hộp quà tặng còn có thể làm sứ giả cho tình yêu của bạn.</p>\r\n\r\n<p style=\"text-align: justify;\">Một chiếc hộp hình trái tim sẽ thay bạn ngỏ lời yêu.</p>\r\n\r\n<p style=\"text-align: justify;\">Một chiếc hộp vuông vức, sang trọng sẽ thay bạn bày tỏ lòng chân thành.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/hop-dung-vat-pham.jpg\" style=\"width: 215px; height: 200px;\" /></p>\r\n\r\n<p style=\"text-align: justify;\">Một chiếc túi xinh xắn sẽ là lời nhắn dễ thương và gần gũi...</p>\r\n\r\n<p style=\"text-align: justify;\">Đừng nên bỏ qua những chi tiết nhỏ nhất để mang đến cảm nhận tuyệt vời nhất cho người nhận quà&nbsp;nhé. Món quà to sẽ không ý nghĩa bằng cách bạn gửi&nbsp;đi một món quà. Hãy để Hộp Giấy&nbsp;Sắc Hoa&nbsp;giúp bạn chuyển lời yêu thương đến người thân, bạn bè của bạn với những thiết kế ấn tượng, độc đáo nhé!</p>\r\n', '', '47723.jpg', '47723_290x230.jpg', 1, 1, 0, 0, '', '', '', '', '', '', 'Ý tưởng thiết kế', '', '', 'Ý tưởng thiết kế', '', '', 'moi', ''),
(14, 'Đồng Hành - Nâng Tầm Thương Hiệu', '', 'Đồng Hành - Nâng Tầm Thương Hiệu', '', '', '', '', 'dong-hanh-nang-tam-thuong-hieu', '', '<p>Chương trình khuyến mãi:&nbsp;Mừng ngày 20/10 - ngày Phụ Nữ Việt Nam!</p>\r\n\r\n<p>Giảm giá: 10% cho khách hàng là nữ&nbsp;khi mua hộp quà tặng tại Hộp Giấy&nbsp;Sắc Hoa.</p>\r\n\r\n<p>Tặng 100 phiếu quà tặng từ ngày 20/10 đến 20/11</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '11817.jpg', '11817_290x230.jpg', 1, 1, 0, 0, '', '', '', '', '', '', 'Đồng Hành - Nâng Tầm Thương Hiệu', '', '', 'Đồng Hành - Nâng Tầm Thương Hiệu', '', '', 'mua-nhieu', ''),
(17, '', '', '', '', '', '', '', '-suc-khoe-va-lam-dep-', 'Shop chuyên hàng nội địa Nhật, nhận đổ buôn và lẻ số lượng lớn, giá tốt nhất tại Tokyo và Việt Nam, giao dịch tại Việt Nam hoặc Tokyo. Chúng tôi với phương châm tận tâm , tận tình sẽ tư vấn cho bạn một sản phẩm cực kỳ tốt nhất.', '', '', '', '', 1, 1, 0, 0, '', '', '', '', '', '', '', '', '', '“ Sức khỏe và làm đẹp ”', '', '', 'ho-tro', ''),
